    @ActionKey("document/download_rule_doc")
    @Clear(LoginIntercept.class)
    public void downloadRuleDoc() {
        int kind = getParaToInt("kind", 1);   //1：根据规则类型   2：根据错误级别
        if (kind != 1 && kind != 2) {
            kind = 1;
        }
        String platform = getPara("platform", "java");
        List<JdcheckRule> rules = JdcheckRule.dao.find("select * from jdcheck_rule where isbase=1 and (opening=1 or from_project_id is not null) and platform like ?", "%" + platform + "%");
        List<JdCheckRuleDocBean> jdCheckRuleDocs = new ArrayList<>();
        if (rules != null && rules.size() > 0) {
            if (kind == 1) {
                for (JdcheckRule item : rules) {
                    if (!StringUtil.isEmpty(item.getDescription())) {
                        item.setDescription(item.getDescription());
                    }
                    if (!StringUtil.isEmpty(item.getBrief())) {
                        item.setBrief(item.getBrief());
                    }
                    if (!StringUtil.isEmpty(item.getExample())) {
                        String example = item.getExample();
                        if(item.getExample().startsWith("[") && item.getExample().endsWith("]")){
                            example = example.substring(1,example.length()-1);
                        }
                        item.setExample(example);
                    }

                    boolean hasAdd = false;
                    for (JdCheckRuleDocBean jdCheckRuleDocBean : jdCheckRuleDocs) {
                        if(!TextUtils.isEmpty(jdCheckRuleDocBean.getRuleType())) {
                            if (jdCheckRuleDocBean.getRuleType().equals(item.getRuleType())) {
                                jdCheckRuleDocBean.getJdcheckRules().add(item);
                                hasAdd = true;
                            }
                        }
                    }
                    if (!hasAdd) {
                        JdCheckRuleDocBean jdCheckRuleDocBean = new JdCheckRuleDocBean();
                        jdCheckRuleDocBean.setRuleType(item.getRuleType());
                        jdCheckRuleDocBean.getJdcheckRules().add(item);
                        jdCheckRuleDocs.add(jdCheckRuleDocBean);
                    }
                }
            } else {
                JdCheckRuleDocBean warning = new JdCheckRuleDocBean();
                warning.setRuleType("Warning(警告)");
                JdCheckRuleDocBean major = new JdCheckRuleDocBean();
                major.setRuleType("Major(一般)");
                JdCheckRuleDocBean critical = new JdCheckRuleDocBean();
                critical.setRuleType("Critical(严重)");
                JdCheckRuleDocBean blocker = new JdCheckRuleDocBean();
                blocker.setRuleType("Blocker(非常严重)");
                for(JdcheckRule item : rules){
                    if (!StringUtil.isEmpty(item.getDescription())) {
                        item.setDescription(item.getDescription());
                    }
                    if (!StringUtil.isEmpty(item.getBrief())) {
                        item.setBrief(item.getBrief());
                    }
                    if (!StringUtil.isEmpty(item.getExample())) {
                        item.setExample(item.getExample());
                    }
                    if(item.getErrorLevel().toLowerCase().equals("low") || item.getErrorLevel().toLowerCase().equals("medium low")){
                        warning.getJdcheckRules().add(item);
                    }else if(item.getErrorLevel().toLowerCase().equals("medium high")){
                        critical.getJdcheckRules().add(item);
                    }else if(item.getErrorLevel().toLowerCase().equals("high")){
                        blocker.getJdcheckRules().add(item);
                    }else {
                        major.getJdcheckRules().add(item);
                    }
                }

                if (warning.getJdcheckRules().size() > 0) {
                    jdCheckRuleDocs.add(warning);
                }
                if (major.getJdcheckRules().size() > 0) {
                    jdCheckRuleDocs.add(major);
                }
                if (critical.getJdcheckRules().size() > 0) {
                    jdCheckRuleDocs.add(critical);
                }
                if (blocker.getJdcheckRules().size() > 0) {
                    jdCheckRuleDocs.add(blocker);
                }
            }
            //开始绘制word
            String filePath = PathKit.getWebRootPath() + File.separator+ "rule_doc"+File.separator+platform+"规则文档_"+System.currentTimeMillis()+".docx";
            WriteRuleDoc.writeRuleToDocx(kind,platform,filePath,jdCheckRuleDocs);
            renderFile(new File(filePath));
            File file = new File(filePath);
            if(file.exists()){
                file.deleteOnExit();
            }
        }else{
            //没有规则
