    @ActionKey("callback/jdcheck/action_jdcheck_finish")
    @Clear(LoginIntercept.class)
    @Before(RequestCheckIntercept.class)
    public void finishJdCheck() {
        int jobNum = getParaToInt("job_num", 0);
        String module_id = getPara("module_id", ""); //这里的module_id是jenkins里面的项目名称
        String branchId = getPara("branch_id", "");
        String jenkins = getPara("jenkins", null);
        if (StringUtil.isEmpty(jenkins)) {
            renderJson(new BaseResponseBean(-1, "请上传jenkins"));
            return;
        }
        if (StringUtil.isEmpty(module_id) || StringUtil.isEmpty(branchId)) {
            renderJson(new BaseResponseBean(-1, "请传入必要参数"));
            return;
        }
        String temp = module_id.substring(module_id.lastIndexOf("-") + 1);
        if (StringUtil.isEmpty(temp)) {
            renderJson(new BaseResponseBean(-1, "请上传正确的module_id"));
            return;
        }
        int moduleId;
        try {
            moduleId = Integer.valueOf(temp);
        } catch (Exception e) {
            renderJson(new BaseResponseBean(-1, "请上传正确的module_id"));
            return;
        }
        ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.checkBranch(moduleId, branchId);
        if (projectModuleInfo == null) {
            renderJson(new BaseResponseBean(-1, "工程不存在或默认分支配置错误!"));
            return;
        }
        JdcheckHistory jdcheckHistory = JdcheckHistory.dao.checkIsExist(moduleId, jobNum, jenkins);
        if (jdcheckHistory == null) {
            renderJson(new BaseResponseBean(-1, "该条jenkins任务还未创建!"));
            return;
        }
        String resultJson = getPara("result_json", "");
        jdcheckHistory.setLog(JenkinsControl.getInstance().getBuildLog(projectModuleInfo.getJenkinsJobName(), jobNum, jenkins));
        boolean isLast = JdcheckHistory.dao.isLastSuccessHistoryInDay(moduleId, jdcheckHistory.getCreateTime());
        if (StringUtil.isEmpty(resultJson)) {
            jdcheckHistory.setJobState(-1);
            jdcheckHistory.setJobErrorReason(ErrorLogReasonUtil.getErrorReason(jdcheckHistory.getLog(), this));
            jdcheckHistory.update();
            renderJson(new BaseResponseBean(null));
        } else {
            JSONObject result = JSON.parseObject(resultJson);
            int blocker = result.getIntValue("blocker");
            int critical = result.getIntValue("critical");
            int major = result.getIntValue("major");
            int warning = result.getIntValue("warning");
            JdcheckResult jdcheckResult = new JdcheckResult();
            jdcheckResult.setNum(blocker + critical + major + warning);
            jdcheckResult.setBlocker(blocker);
            jdcheckResult.setCritical(critical);
            jdcheckResult.setMajor(major);
            jdcheckResult.setWarning(warning);
            jdcheckResult.setHasdetail(0);
            jdcheckResult.save();
            jdcheckHistory.setJobState(2);
            jdcheckHistory.setResultId(jdcheckResult.getId());
            jdcheckHistory.update();
            HashMap<String, Boolean> needDetail = new HashMap<>();
            if (!isLast) {
                ModuleDayResultCache.cache.setDataModuleAnaly(jdcheckHistory, jdcheckResult, jdcheckHistory.getCreateTime());
                needDetail.put("need_detail", false);
                renderJson(new BaseResponseBean<HashMap<String, Boolean>>(0, needDetail, "不需要上传详情"));
            } else {
                needDetail.put("need_detail", true);
                renderJson(new BaseResponseBean<HashMap<String, Boolean>>(0, needDetail, "需要上传详情"));
            }
        }
    }

