    /**
     * 同步数据库项目和jenkins项目
     */
    @ActionKey("callback/jdcheck/action_update_jenkins_module")
    @Clear(LoginIntercept.class)
    @Before(RequestCheckIntercept.class)
    public void updateJenkinsModule() {
        StringBuilder error = new StringBuilder();
        boolean allSuccess = true;
        List<ProjectModuleInfo> datas = ProjectModuleInfo.dao.find("select * from project_module_info");
        if (datas != null && datas.size() > 0) {
            for (int i = 0; i < datas.size(); i++) {
                String gitUrl = datas.get(i).getGitUrl();
                String jenkinsUrl = datas.get(i).getAutojenkinsurl();
                int projectId = datas.get(i).getProjectId();
                String platform = datas.get(i).getPlatform();

                CreateResult jenkinsResult = null;
                if (GitMemberUtil.checkCommenUserPermission(gitUrl)) {
                    String storageGitUrl = gitUrl;
//                    if (gitUrl.contains("gitlab.ctrlle.com")) {
//                        storageGitUrl = storageGitUrl.replace("http://gitlab.ctrlle.com/", "git@gitlab.ctrlle.com:");
//                    }
                    StringBuilder jobxml = null;


                    List<String> jenkinsUrls = new ArrayList<>();
                    List<String> jenkins = Jenkins.dao.getJenkinsUrlByProjectId(projectId, gitUrl.trim(), platform);

                    jobxml = JobConfigUtil.getEosStringValue();
                    jenkinsUrls = jenkins;
                    String userId = Jenkins.dao.getUserIdByJenkinsUrl(jenkinsUrls.get(0), storageGitUrl);
                    jenkinsResult = JenkinsControl.getInstance().createJob(datas.get(i).getJenkinsJobName(), storageGitUrl, userId, jobxml, jenkinsUrls);


                } else {
                    jenkinsResult = CreateResult.PERMISSIONSERROR;
                }
                if (jenkinsResult != CreateResult.SUCCESS && jenkinsResult != CreateResult.ALREADYEXISTS) {
                    allSuccess = false;
                    if (jenkinsResult == CreateResult.PERMISSIONSERROR) {
                        error.append(datas.get(i).getId() + "  " + datas.get(i).getModuleEn() + "  权限错误\n");
                    } else {
                        error.append(datas.get(i).getId() + "  " + datas.get(i).getModuleEn() + "  失败\n");
                    }
                }
            }
            if (allSuccess) {
                renderHtml(datas.size() + "  成功");
            } else {
                renderHtml(error.toString());
            }
        } else {
            renderHtml("没有需要创建的工程");
        }
    }

