    public MonthEmailDataBean getMonthDatautil(String cTime, Integer days, String platform, Integer projectId, String erp) {
        Project project = Project.dao.findById(projectId);
        Calendar curCalendar = Calendar.getInstance(Locale.CHINA);
        if (cTime != null) {
            curCalendar.set(Calendar.YEAR, Integer.parseInt(cTime.substring(0, 4)));
            curCalendar.set(Calendar.MONTH, Integer.parseInt(cTime.substring(4, 6)) - 1);
            curCalendar.set(Calendar.DAY_OF_MONTH, Integer.parseInt(cTime.substring(6, 8)));
        }
        curCalendar.set(Calendar.HOUR_OF_DAY, 23);
        curCalendar.set(Calendar.MINUTE, 59);
        curCalendar.set(Calendar.SECOND, 59);
        curCalendar.set(Calendar.MILLISECOND, 999);
        MonthEmailDataBean result = new MonthEmailDataBean();
        List<ProjectModuleInfo> temp1;
        if (platform == null) {
            temp1 = ProjectModuleInfo.dao.find("select * from project_module_info where project_id = ? and time<? and (outtime is null or outtime >?)", projectId, new Date(curCalendar.getTimeInMillis() - days * ONEDAY + 1), new Date(curCalendar.getTimeInMillis()));
        } else {
            temp1 = ProjectModuleInfo.dao.find("select * from project_module_info where project_id = ? and time<? and (outtime is null or outtime >?) and platform= ?", projectId, new Date(curCalendar.getTimeInMillis() - days * ONEDAY + 1), new Date(curCalendar.getTimeInMillis()), platform);
        }
        result.getEffModules().addAll(temp1);
        List<ProjectModuleInfo> temp2;
        if (platform == null) {
            temp2 = ProjectModuleInfo.dao.find("select * from project_module_info where project_id = ? and outtime is not null and outtime > ? and outtime < ?", projectId, new Date(curCalendar.getTimeInMillis() - days * ONEDAY + 1), new Date(curCalendar.getTimeInMillis()));
        } else {
            temp2 = ProjectModuleInfo.dao.find("select * from project_module_info where project_id = ? and outtime is not null and outtime > ? and outtime < ? and platform=?", projectId, new Date(curCalendar.getTimeInMillis() - days * ONEDAY + 1), new Date(curCalendar.getTimeInMillis()), platform);
        }
        result.getOutModules().addAll(temp2);
        List<ProjectModuleInfo> temp3;
        if (platform == null) {
            temp3 = ProjectModuleInfo.dao.find("select * from project_module_info where project_id = ? and time>? and time < ? and (outtime is null or outtime >?)", projectId, new Date(curCalendar.getTimeInMillis() - days * ONEDAY + 1), new Date(curCalendar.getTimeInMillis()), new Date(curCalendar.getTimeInMillis()));
        } else {
            temp3 = ProjectModuleInfo.dao.find("select * from project_module_info where project_id = ? and time>? and time < ? and (outtime is null or outtime >?) and platform=?", projectId, new Date(curCalendar.getTimeInMillis() - days * ONEDAY + 1), new Date(curCalendar.getTimeInMillis()), new Date(curCalendar.getTimeInMillis()), platform);
        }
        result.getNewModules().addAll(temp3);
        JdCheckAnalyBean temp4 = JdCheckAnalyModel.dao.getProjectAnalyDatas(project, curCalendar.getTimeInMillis(), days, platform);
        result.setMonthData(temp4);

        if (!((temp1 == null || temp1.size() == 0) && (temp2 == null || temp2.size() == 0) && (temp3 == null || temp3.size() == 0))) {
            List<JdCheckAnalyBean> datas = JdCheckAnalyModel.dao.getMyWatchModuleAnalyDatas(curCalendar.getTimeInMillis(), days, erp, projectId, null, false, platform);
            int cut1 = 0;
            int newBlockcut = 0;
            int newCriticalcut = 0;
            int newMajorcut = 0;
            int newwarningcut = 0;

            int effBlockcut = 0;
            int effCriticalcut = 0;
            int effMajorcut = 0;
            int effWarningcut = 0;

            int cut2 = 0;
            if (datas != null && datas.size() > 0) {
                for (int i = 0; i < datas.size(); i++) {
                    boolean isExist = false;
                    int state = 0;
                    if (temp1 != null && temp1.size() > 0 && !isExist) {
                        for (ProjectModuleInfo item : temp1) {
                            if (item.getId().intValue() == datas.get(i).getModuleId()) {
                                isExist = true;
                                state = 0;
                                break;
                            }
                        }
                    }
                    if (temp2 != null && temp2.size() > 0 && !isExist) {
                        for (ProjectModuleInfo item : temp2) {
                            if (item.getId().intValue() == datas.get(i).getModuleId()) {
                                isExist = true;
                                state = -1;
                                break;
                            }
                        }
                    }
                    if (temp3 != null && temp3.size() > 0 && !isExist) {
                        for (ProjectModuleInfo item : temp3) {
                            if (item.getId().intValue() == datas.get(i).getModuleId()) {
                                isExist = true;
                                state = 1;
                                break;
                            }
                        }
                    }
                    if (!isExist) {
                        datas.remove(i);
                        i--;
                    } else {
                        MonthCutDataBean monthCutDataBean = new MonthCutDataBean();
                        monthCutDataBean.setState(state);
                        monthCutDataBean.setModuleId(datas.get(i).getModuleId());
                        monthCutDataBean.setModuleName(datas.get(i).getModuleCn());
                        monthCutDataBean.setStartData(getStartData(datas.get(i).getNum()));
                        monthCutDataBean.setEndData(getEndData(datas.get(i).getNum()));
                        monthCutDataBean.setStartBlocker(getStartData(datas.get(i).getBlocker()));
                        monthCutDataBean.setStartCritical(getStartData(datas.get(i).getCritical()));
                        monthCutDataBean.setStartMajor(getStartData(datas.get(i).getMajor()));
                        monthCutDataBean.setStartWarning(getStartData(datas.get(i).getWarning()));
                        monthCutDataBean.setBlocker(getEndData(datas.get(i).getBlocker()));
                        monthCutDataBean.setCritical(getEndData(datas.get(i).getCritical()));
                        monthCutDataBean.setMajor(getEndData(datas.get(i).getMajor()));
                        monthCutDataBean.setWarning(getEndData(datas.get(i).getWarning()));
                        List<ProjectModuleUser> projectModuleUsers = ProjectModuleUser.dao.find("select username from project_module_user where module_id=? and level=3", datas.get(i).getModuleId());
                        if (projectModuleUsers != null && projectModuleUsers.size() > 0) {
                            monthCutDataBean.setAuthor(projectModuleUsers.get(0).getUsername());
                        }
                        monthCutDataBean.setCut(monthCutDataBean.getEndData() != null && monthCutDataBean.getStartData() != null ? monthCutDataBean.getEndData().intValue() - monthCutDataBean.getStartData().intValue() : null);
                        monthCutDataBean.setBlockcut(monthCutDataBean.getBlocker() != null && monthCutDataBean.getStartBlocker() != null ? monthCutDataBean.getBlocker().intValue() - monthCutDataBean.getStartBlocker().intValue() : null);
                        monthCutDataBean.setCriticalcut(monthCutDataBean.getCritical() != null && monthCutDataBean.getStartCritical() != null ? monthCutDataBean.getCritical().intValue() - monthCutDataBean.getStartCritical().intValue() : null);
                        monthCutDataBean.setMajorcut(monthCutDataBean.getMajor() != null && monthCutDataBean.getStartMajor() != null ? monthCutDataBean.getMajor().intValue() - monthCutDataBean.getStartMajor().intValue() : null);
                        monthCutDataBean.setWarningcut(monthCutDataBean.getWarning() != null && monthCutDataBean.getStartWarning() != null ? monthCutDataBean.getWarning().intValue() - monthCutDataBean.getStartWarning().intValue() : null);


                        result.getMonthEmailDatas().add(monthCutDataBean);
                        if (state == 1) {
                            cut1 = cut1 + (monthCutDataBean.getCut() == null ? 0 : monthCutDataBean.getCut().intValue());
                            newBlockcut = newBlockcut + (monthCutDataBean.getBlockcut() == null ? 0 : monthCutDataBean.getBlockcut().intValue());
                            newCriticalcut = newCriticalcut + (monthCutDataBean.getCriticalcut() == null ? 0 : monthCutDataBean.getCriticalcut().intValue());
                            newMajorcut = newMajorcut + (monthCutDataBean.getMajorcut() == null ? 0 : monthCutDataBean.getMajorcut().intValue());
                            newwarningcut = newwarningcut + (monthCutDataBean.getWarningcut() == null ? 0 : monthCutDataBean.getWarningcut().intValue());

                        } else {
                            cut2 = cut2 + (monthCutDataBean.getCut() == null ? 0 : monthCutDataBean.getCut().intValue());
                            effBlockcut = effBlockcut + (monthCutDataBean.getBlockcut() == null ? 0 : monthCutDataBean.getBlockcut().intValue());
                            effCriticalcut = effCriticalcut + (monthCutDataBean.getCriticalcut() == null ? 0 : monthCutDataBean.getCriticalcut().intValue());
                            effMajorcut = effMajorcut + (monthCutDataBean.getMajorcut() == null ? 0 : monthCutDataBean.getMajorcut().intValue());
                            effWarningcut = effWarningcut + (monthCutDataBean.getWarningcut() == null ? 0 : monthCutDataBean.getWarningcut().intValue());
                        }
                    }
                }
            }
            result.setNewCut(cut1);
            result.setEffCut(cut2);

            result.setNewBlockCut(newBlockcut);
            result.setNewCriticalCut(newCriticalcut);
            result.setNewMajorCut(newMajorcut);
            result.setNewWarningCut(newwarningcut);

            result.setEffBlockCut(effBlockcut);
            result.setEffCriticalCut(effCriticalcut);
            result.setEffMajorCut(effMajorcut);
            result.setEffWarningCut(effWarningcut);


        }
        return result;

    }


    private Integer getStartData(List<Integer> num) {
        if (num != null && num.size() > 0) {
            for (int i = 0; i < num.size(); i++) {
                if (num.get(i) != null) {
                    return num.get(i);
                }
            }
        }
        return null;
    }

    private Integer getEndData(List<Integer> num) {
        if (num != null && num.size() > 0) {
            for (int i = num.size() - 1; i >= 0; i--) {
                if (num.get(i) != null) {
                    return num.get(i);
                }
            }
        }
        return null;
    }

