        if (startTime == null) {
            renderJson(new BaseResponseBean(-1, "缺少startTime参数"));
            return;
        }
        startCalendar.set(Calendar.YEAR, Integer.parseInt(startTime.substring(0, 4)));
        startCalendar.set(Calendar.MONTH, Integer.parseInt(startTime.substring(4, 6)) - 1);
        startCalendar.set(Calendar.DAY_OF_MONTH, Integer.parseInt(startTime.substring(6, 8)));
        startCalendar.set(Calendar.HOUR_OF_DAY, 23);
        startCalendar.set(Calendar.MINUTE, 59);
        startCalendar.set(Calendar.SECOND, 59);
        startCalendar.set(Calendar.MILLISECOND, 999);

        Integer moduleId = getParaToInt("module_id", null);
        if (moduleId == null) {
            renderJson(new BaseResponseBean(-1, "缺少moduleId参数"));
            return;
        }

        ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.findById(moduleId);
        if (projectModuleInfo == null) {
            renderJson(new BaseResponseBean(-1, "没有该moduleId工程"));
            return;
        }

        List<JdcheckResult> temp1 = JdcheckResult.dao.find("select jdcheck_result.* from jdcheck_result,jdcheck_history where jdcheck_history.module_id=? and jdcheck_history.create_time<=? and jdcheck_history.job_state=2 and jdcheck_result.hasdetail=1 and jdcheck_result.id=jdcheck_history.result_id order by create_time desc limit 1", moduleId, endCalendar.getTime());
