            renderJson(new BaseResponseBean(-1, "暂无该工程在该时段的扫描详情"));
            return;
        }
        List<JdcheckResult> temp2 = JdcheckResult.dao.find("select jdcheck_result.* from jdcheck_result,jdcheck_history where jdcheck_history.module_id=? and jdcheck_history.create_time<=? and jdcheck_history.job_state=2 and jdcheck_result.hasdetail=1 and jdcheck_result.id=jdcheck_history.result_id order by create_time desc limit 1", moduleId, startCalendar.getTime());
        if (temp2 == null || temp2.size() == 0) {
            JdCheckDayReportBean jdCheckDayReportBean = new JdCheckDayReportBean();
            JdcheckResult oneResult = temp1.get(0);
            jdCheckDayReportBean.setJdcheckResult(oneResult);
            List<JdcheckResultFile> oneResultFile = JdcheckResultFile.dao.find("select * from jdcheck_result_file where resultid=?", oneResult.getId());
            if (oneResultFile == null || oneResultFile.size() == 0) {
                renderJson(new BaseResponseBean(-1, "结果集 " + oneResult.getId() + "对应的文件列表丢失，请联系管理员查看"));
                return;
            }
            jdCheckDayReportBean.setFilesCount(oneResultFile.size());
            renderJson(new BaseResponseBean<JdCheckDayReportBean>(jdCheckDayReportBean));
        } else {
            JdcheckResult oneResult = temp1.get(0);
            JdcheckResult twoResult = temp2.get(0);
            List<JdcheckResultFile> oneResultFile;
            if (oneResult.getNum() == null || oneResult.getNum().intValue() == 0) {
                oneResultFile = new ArrayList<>();
            } else {
                oneResultFile = JdcheckResultFile.dao.find("select * from jdcheck_result_file where resultid=?", oneResult.getId());
                if (oneResultFile == null || oneResultFile.size() == 0) {
                    renderJson(new BaseResponseBean(-1, "结果集 " + oneResult.getId() + "对应的文件列表丢失，请联系管理员查看"));
                    return;
                }
            }
            List<JdcheckResultFile> twoResultFile;
            if (twoResult.getNum() == null || twoResult.getNum().intValue() == 0) {
                twoResultFile = new ArrayList<>();
            } else {
                twoResultFile = JdcheckResultFile.dao.find("select * from jdcheck_result_file where resultid=?", twoResult.getId());
                if (twoResultFile == null || twoResultFile.size() == 0) {
                    renderJson(new BaseResponseBean(-1, "结果集 " + twoResult.getId() + "对应的文件列表丢失，请联系管理员查看"));
                    return;
                }
            }

            //开始比对两份结果详情
            JdCheckDayReportBean jdCheckDayReportBean = new JdCheckDayReportBean();
            jdCheckDayReportBean.setJdcheckResult(oneResult);
            jdCheckDayReportBean.setFilesCount(oneResultFile.size());
            jdCheckDayReportBean.setChangeCount(oneResult.getNum() - twoResult.getNum());

            int changeCountNumInReviseFile = 0;
            int changeCountBlockInReviseFile = 0;
            int changeCountMajorInReviseFile = 0;
            int changeCountCriticalInReviseFile = 0;
            int changeCountWarningInReviseFile = 0;
            for (int i = 0; i < oneResultFile.size(); i++) {
                boolean isAdd = true;
                for (int j = 0; j < twoResultFile.size(); j++) {
                    if (oneResultFile.get(i).getPath().equals(twoResultFile.get(j).getPath())) {
                        isAdd = false;
                        if (!oneResultFile.get(i).getHashcode().equals(twoResultFile.get(j).getHashcode())) {
                            jdCheckDayReportBean.getReviseFiles().add(oneResultFile.get(i).getPath());
                            jdCheckDayReportBean.getReviseFilesAuthors().add(oneResultFile.get(i).getAuthor());
                            jdCheckDayReportBean.getReviseFilesOperators().add(oneResultFile.get(i).getOperator());
                            jdCheckDayReportBean.setNumInReviseFile(jdCheckDayReportBean.getNumInReviseFile() + oneResultFile.get(i).getNum());
                            jdCheckDayReportBean.setBlockInReviseFile(jdCheckDayReportBean.getBlockInReviseFile() + oneResultFile.get(i).getBlocker());
                            jdCheckDayReportBean.setWarningInReviseFile(jdCheckDayReportBean.getWarningInReviseFile() + oneResultFile.get(i).getWarning());
                            jdCheckDayReportBean.setCriticalInReviseFile(jdCheckDayReportBean.getCriticalInReviseFile() + oneResultFile.get(i).getCritical());
                            jdCheckDayReportBean.setMajorInReviseFile(jdCheckDayReportBean.getMajorInReviseFile() + oneResultFile.get(i).getMajor());

                            changeCountNumInReviseFile = changeCountNumInReviseFile + (oneResultFile.get(i).getNum() - twoResultFile.get(j).getNum());
                            changeCountBlockInReviseFile = changeCountBlockInReviseFile + (oneResultFile.get(i).getBlocker() - twoResultFile.get(j).getBlocker());
                            changeCountMajorInReviseFile = changeCountMajorInReviseFile + (oneResultFile.get(i).getMajor() - twoResultFile.get(j).getMajor());
                            changeCountCriticalInReviseFile = changeCountCriticalInReviseFile + (oneResultFile.get(i).getCritical() - twoResultFile.get(j).getCritical());
                            changeCountWarningInReviseFile = changeCountWarningInReviseFile + (oneResultFile.get(i).getWarning() - twoResultFile.get(j).getWarning());
                        } else {
                            jdCheckDayReportBean.setNumInOtherFile(jdCheckDayReportBean.getNumInOtherFile() + oneResultFile.get(i).getNum());
                            jdCheckDayReportBean.setBlockInOtherFile(jdCheckDayReportBean.getBlockInOtherFile() + oneResultFile.get(i).getBlocker());
                            jdCheckDayReportBean.setWarningInOtherFile(jdCheckDayReportBean.getWarningInOtherFile() + oneResultFile.get(i).getWarning());
                            jdCheckDayReportBean.setCriticalInOtherFile(jdCheckDayReportBean.getCriticalInOtherFile() + oneResultFile.get(i).getCritical());
                            jdCheckDayReportBean.setMajorInOtherFile(jdCheckDayReportBean.getMajorInOtherFile() + oneResultFile.get(i).getMajor());
                        }
                        break;
                    }
                }
                if (isAdd) {
                    jdCheckDayReportBean.getAddFiles().add(oneResultFile.get(i).getPath());
                    jdCheckDayReportBean.getAddFilesAuthors().add(oneResultFile.get(i).getAuthor());
                    jdCheckDayReportBean.setNumInAddFile(jdCheckDayReportBean.getNumInAddFile() + oneResultFile.get(i).getNum());
                    jdCheckDayReportBean.setBlockInAddFile(jdCheckDayReportBean.getBlockInAddFile() + oneResultFile.get(i).getBlocker());
                    jdCheckDayReportBean.setWarningInAddFile(jdCheckDayReportBean.getWarningInAddFile() + oneResultFile.get(i).getWarning());
                    jdCheckDayReportBean.setCriticalInAddFile(jdCheckDayReportBean.getCriticalInAddFile() + oneResultFile.get(i).getCritical());
                    jdCheckDayReportBean.setMajorInAddFile(jdCheckDayReportBean.getMajorInAddFile() + oneResultFile.get(i).getMajor());
                }
            }
            jdCheckDayReportBean.setChangeCountNumInReviseFile(changeCountNumInReviseFile);
            jdCheckDayReportBean.setChangeCountBlockInReviseFile(changeCountBlockInReviseFile);
            jdCheckDayReportBean.setChangeCountCriticalInReviseFile(changeCountCriticalInReviseFile);
            jdCheckDayReportBean.setChangeCountMajorInReviseFile(changeCountMajorInReviseFile);
            jdCheckDayReportBean.setChangeCountWarningInReviseFile(changeCountWarningInReviseFile);

            for (int i = 0; i < twoResultFile.size(); i++) {
                boolean isDelete = true;
                for (int j = 0; j < oneResultFile.size(); j++) {
                    if (twoResultFile.get(i).getPath().equals(oneResultFile.get(j).getPath())) {
                        isDelete = false;
                        break;
                    }
                }
                if (isDelete) {
                    jdCheckDayReportBean.getDeleteFiles().add(twoResultFile.get(i).getPath());
                    jdCheckDayReportBean.getDeleteFilesAuthors().add(twoResultFile.get(i).getAuthor());
                    jdCheckDayReportBean.setNumInDeleteFile(jdCheckDayReportBean.getNumInDeleteFile() + twoResultFile.get(i).getNum());
                    jdCheckDayReportBean.setBlockInDeleteFile(jdCheckDayReportBean.getBlockInDeleteFile() + twoResultFile.get(i).getBlocker());
                    jdCheckDayReportBean.setWarningInDeleteFile(jdCheckDayReportBean.getWarningInDeleteFile() + twoResultFile.get(i).getWarning());
                    jdCheckDayReportBean.setCriticalInDeleteFile(jdCheckDayReportBean.getCriticalInDeleteFile() + twoResultFile.get(i).getCritical());
                    jdCheckDayReportBean.setMajorInDeleteFile(jdCheckDayReportBean.getMajorInDeleteFile() + twoResultFile.get(i).getMajor());
                }
            }
            renderJson(new BaseResponseBean<JdCheckDayReportBean>(jdCheckDayReportBean));
        }
    }


