        Map<String, String> map = new HashMap<>();
        AAA(result, 0, map);
    }

    private void AAA(List<PluginLocalPoint> result, int index, Map<String, String> map) {
        System.out.println(index);
        PluginLocalPoint pluginLocalPoint = result.get(index);
        if (TextUtils.isEmpty(pluginLocalPoint.getProjectName())) {
            if (!TextUtils.isEmpty(pluginLocalPoint.getUniqueId())) {
                String projectName = "";
