                    if (!TextUtils.isEmpty(LoginUtil.getOrganizationFullName(pluginLocalPoint.getUniqueId()))) {
                        projectName = LoginUtil.getOrganizationFullName(pluginLocalPoint.getUniqueId());
                        AccountInfoBean accountInfoBean = LoginUtil.getLeaderInfo(pluginLocalPoint.getUniqueId());
                        if (accountInfoBean != null) {
                            if (!TextUtils.isEmpty(accountInfoBean.getRealName())) {
                                projectName = projectName + "(" + accountInfoBean.getRealName() + ")";
                            }

                        }
                        map.put(uniqueId, projectName);

                    } else {
                        projectName = "";
                        map.put(uniqueId, "");
                    }
                    pluginLocalPoint.setProjectName(projectName);
                    pluginLocalPoint.update();
                    try {
                        Thread.sleep(100);
                    } catch (InterruptedException e) {
                        e.printStackTrace();
                    }
                }
            }
        }
        AAA(result, ++index, map);

    }


