    @ActionKey("callback/jdcheck/getModulesByUser")
    @Clear(LoginIntercept.class)
    @Before(RequestCheckIntercept.class)
    public void getModulesByUser() {
        List<Integer> offEmailModuleList = EmailSwitch.dao.getEndIsOffModuleId();
        String notExistList = "";
        if (offEmailModuleList != null && offEmailModuleList.size() > 0) {
            for (int i = 0; i < offEmailModuleList.size(); i++) {
                if (i == 0 || i == offEmailModuleList.size()) {
                    notExistList = notExistList + offEmailModuleList.get(i);
                } else {
                    notExistList = notExistList + "," + offEmailModuleList.get(i);
                }

            }
            notExistList = " and user.module_id not in (" + notExistList + ")";
        }
        List<Record> list = Db.find("select user.erp,user.email,user.module_id,module.module_en,module_cn from project_module_user user,project_module_info module where user.module_id=module.id and (module.outtime is null or module.outtime > ?)" + notExistList, new Date());
        List<EmailUserInfoBean> result = new ArrayList<>();

        if (list == null || list.size() == 0) {
            renderJson(new BaseResponseBean(-1, "用户列表为空"));
            return;
        }


        for (int j = 0; j < list.size(); j++) {
            EmailModuleBean user = new EmailModuleBean(list.get(j));
            String erp = user.getErp();
            boolean hasAdd = false;
            for (int i = 0; i < result.size(); i++) {
                {
                    EmailUserInfoBean bean = result.get(i);
                    if (bean.getAuthor().equals(erp)) {
                        hasAdd = true;
                        List<String> modules = bean.getModules();
                        modules.add(user.getModuleEn() + "-" + user.getModuleId());
                        bean.setModules(modules);
                        break;
                    }
                }
            }
            if (!hasAdd) {
                EmailUserInfoBean emailUserInfoBean = new EmailUserInfoBean();
                if (!TextUtils.isEmpty(user.getErp())) {
                    emailUserInfoBean.setAuthor(user.getErp());
                    emailUserInfoBean.setEmail(user.getEmail());
                    List<String> modules = new ArrayList<>();
                    modules.add(user.getModuleEn() + "-" + user.getModuleId());
                    emailUserInfoBean.setModules(modules);
                    result.add(emailUserInfoBean);
                }
            }
            renderJson(new BaseResponseBean<List<EmailUserInfoBean>>(result));

        }
    }


