    private void setProjectData(int i, List<ProjectBean> result, Project project) {
        String[] names = project.getName().split("-");
        if (names != null && i < names.length) {
            if (i == names.length - 1) {
                ProjectBean p = new ProjectBean();
                p.setName(names[i]);
                p.setId(project.getId());
                result.add(p);
            } else {
                boolean insert = false;
                for (ProjectBean item : result) {
                    if (item.getName().equals(names[i])) {
                        insert = true;
                        setProjectData(i + 1, item.getDatas(), project);
                        break;
                    }
                }
                if (!insert) {
                    ProjectBean p = new ProjectBean();
                    p.setName(names[i]);
                    p.setDatas(new ArrayList<>());
                    result.add(p);
                    setProjectData(i + 1, p.getDatas(), project);
                }
            }
        }
    }

