    @ActionKey("join/addmodule")
    public void addModule() {
        String originization = getPara("originization", null);
        if (StringUtil.isEmpty(originization)) {
            originization = "其他";
        }
        String appGroup = getPara("appGroup_id", "");
        int appName = getParaToInt("appName_id", 0);
        if (StringUtil.isEmpty(StringUtil.getNoTrimString(appGroup))) {
            renderJson(new BaseResponseBean(-1, "请选择应用分类"));
            return;
        }
        if (appName == 0) {
            appName = ProjectModuleApp.dao.selectAppGroupIsNone(appGroup);
            if (appName == -1) {
                renderJson(new BaseResponseBean(-1, "请选择应用详细名称"));
                return;
            }
        }

        String gitUrl = getPara("git_url", "");
        if (StringUtil.isEmpty(gitUrl.trim())) {
            renderJson(new BaseResponseBean(-1, "请输入工程git地址"));
            return;
        }
        //统一git地址为http://git.jd.com/****格式
        String regex = "git@([\\w-]+\\.)+[\\w-]+(\\:[\\w- .\\/?%&=]*)?.git";
        if (gitUrl.trim().matches(regex)) {
            String oldStr = gitUrl.trim().substring(0, gitUrl.indexOf(":") + 1);
            String newStr = "http://" + gitUrl.trim().substring(4, gitUrl.trim().indexOf(":")) + "/";
            gitUrl = gitUrl.replace(oldStr, newStr);
        }

        String moduleEn = gitUrl.substring(gitUrl.lastIndexOf("/") + 1, gitUrl.indexOf(".git"));
        if (StringUtil.isEmpty(moduleEn)) {
            renderJson(new BaseResponseBean(-1, "git地址不合法"));
            return;
        }

        String moduleCn = getPara("module_cn", "");
        String moduleDesc = getPara("module_desc", "");
        String branch = getPara("branch", "");
        if (StringUtil.isEmpty(branch.trim())) {
            renderJson(new BaseResponseBean(-1, "请输入自动扫描的分支"));
            return;
        }
        String platform = getPara("platform", "");
        if (StringUtil.isEmpty(platform.trim())) {
            renderJson(new BaseResponseBean(-1, "请选择编写语言平台"));
            return;
        }

        String erp = getPara("erp", "");
        if (StringUtil.isEmpty(erp.trim())) {
            renderJson(new BaseResponseBean(-1, "请输入管理员erp"));
            return;
        }
        String username = getPara("username", "");
        if (StringUtil.isEmpty(username.trim())) {
            renderJson(new BaseResponseBean(-1, "请输入管理员姓名"));
            return;
        }
        String email = getPara("email", "");
        if (StringUtil.isEmpty(email.trim())) {
            renderJson(new BaseResponseBean(-1, "请输入管理员邮箱"));
            return;
        }

        Integer projectId = Project.dao.checkProjectIsExists(originization);

        //检查该Git地址是否已接入过
        if (ProjectModuleInfo.dao.isExits(projectId, gitUrl.trim())) {
            renderJson(new BaseResponseBean(-2, "在该项目下，已添加该工程！"));
            return;
        }

        // 数据库存储job详情
        ProjectModuleInfo projectModuleInfo = new ProjectModuleInfo();
        projectModuleInfo.setAppid(appName);
        projectModuleInfo.setProjectId(projectId);
        projectModuleInfo.setModuleEn(moduleEn.trim());
        projectModuleInfo.setModuleCn(moduleCn.trim());
        projectModuleInfo.setBranch(branch.trim());
        projectModuleInfo.setDesc(moduleDesc);
        projectModuleInfo.setPlatform(platform.trim().toLowerCase());
        projectModuleInfo.setGitUrl(gitUrl.trim());

        //设置job的随机ID
        int randomId = -1;
        while (true) {
            randomId = (int) (Math.random() * 100000000);
            ProjectModuleInfo isEx = ProjectModuleInfo.dao.findById(randomId);
            if (isEx == null) {
                break;
            }
        }
        projectModuleInfo.setId(randomId);

        //设置job的服务器地址并在jenkins创建job
        String autoJenkinsurl = "";


        try {
            String jobUrl = projectModuleInfo.getGitUrl();
            CreateResult jenkinsResult = null;
            StringBuilder jobXmlModule = null;
            if (GitMemberUtil.checkCommenUserPermission(jobUrl)) {

                jobXmlModule = JobConfigUtil.getEosStringValue();
                //适配jenkins分布式集群部署问题
                List<String> jenkins = Jenkins.dao.getJenkinsUrlByProjectId(projectModuleInfo.getProjectId(), gitUrl.trim(), platform);
                if (jenkins != null && jenkins.size() > 0) {
                    autoJenkinsurl = jenkins.get(0);
                } else {
                    renderJson(new BaseResponseBean(-1, "未能找到指定jenkins创建job,请联系xuyanling6!"));
                    return;
                }
                if ("ios".equals(platform)) {
                    jenkinsResult = CreateResult.SUCCESS;
                } else {
                    String userId = Jenkins.dao.getUserIdByJenkinsUrl(jenkins.get(0), gitUrl).trim();

                    //非ios项目的Git地址在jenkins端使用SSH地址
                    String jenkinsGitUrl = gitUrl.trim();
//                    if (gitUrl.contains("gitlab.ctrlle.com")) {
//                        jenkinsGitUrl = jenkinsGitUrl.replace("http://gitlab.ctrlle.com/", "git@gitlab.ctrlle.com:");
//
//                    }
                    autoJenkinsurl = jenkins.get(0);

                    //jenkins上创建Job
                    jenkinsResult = JenkinsControl.getInstance().createJob(projectModuleInfo.getJenkinsJobName(), jenkinsGitUrl, userId, jobXmlModule, jenkins);
                }

            } else {
                jenkinsResult = CreateResult.PERMISSIONSERROR;
            }
            if (jenkinsResult != CreateResult.SUCCESS && jenkinsResult != CreateResult.ALREADYEXISTS) {
                if (jenkinsResult == CreateResult.PERMISSIONSERROR) {
                    renderJson(new BaseResponseBean(-3, "Jenkins账户没有拉取项目代码权限,请赋予" + JobConfigUtil.JENKINS_ACCOUNT + "账户拉取代码权限!"));
                } else {
                    renderJson(new BaseResponseBean(-3, "Jenkins创建工程失败!联系管理员"));
                }
                return;
            }


        } catch (Exception e) {
            e.printStackTrace();
