    @ActionKey("me/module/analysis/detailitem")
    public void getDetailItemData(){
        Integer resultId = getParaToInt("result_id");
        if(resultId==null){
            renderJson(new BaseResponseBean(-1,"缺少resultId"));
            return ;
        }
        JdcheckResult jdcheckResult = JdcheckResult.dao.findById(resultId);
        if(jdcheckResult==null){
            renderJson(new BaseResponseBean(-1,"该resultId不存在"));
            return ;
        }
        if(1!=jdcheckResult.getHasdetail()){
            renderJson(new BaseResponseBean(1,null));
            return ;
        }
        String param = getPara("param",null);
        if(StringUtil.isEmpty(param)){
            renderJson(new BaseResponseBean(-1,"缺少param"));
            return ;
        }
        String[] params = param.split("@-@");
        if(params==null || params.length==0){
            renderJson(new BaseResponseBean(-1,"param异常"));
            return ;
        }
        String priority = params[0];
        List<JdcheckScanDetailBean> jdcheckScanDetails = new ArrayList<>();
        if(params.length==1){
            List<JdcheckResultDetail> jdcheckResultDetails = JdcheckResultDetail.dao.find("select ruleDes,count(*) from jdcheck_result_detail where resultid=? and priority=? group by ruleDes order by ruleDes asc",resultId,priority);
            if(jdcheckResultDetails==null || jdcheckResultDetails.size()==0){
                renderJson(new BaseResponseBean(1,null));
                return ;
            }

            for(int i=0;i<jdcheckResultDetails.size();i++){
                JdcheckScanDetailBean item = new JdcheckScanDetailBean();
                item.setLevel(2);
                item.setParam(jdcheckResultDetails.get(i).getRuleDes());
                item.setTitle(jdcheckResultDetails.get(i).getRuleDes());
                item.setCount(jdcheckResultDetails.get(i).getLong("count(*)"));
                jdcheckScanDetails.add(item);
            }
        }
        else if(params.length==2){
            List<JdcheckResultDetail> jdcheckResultDetails = JdcheckResultDetail.dao.find("select class_name,count(*) from jdcheck_result_detail where resultid=? and priority=? and ruleDes=? group by class_name order by class_name asc",resultId,priority,params[1]);
            if(jdcheckResultDetails==null || jdcheckResultDetails.size()==0){
                renderJson(new BaseResponseBean(1,null));
                return ;
            }

            for(int i=0;i<jdcheckResultDetails.size();i++){
                JdcheckScanDetailBean item = new JdcheckScanDetailBean();
                item.setLevel(3);
                item.setParam(jdcheckResultDetails.get(i).getClassName());
                item.setTitle(jdcheckResultDetails.get(i).getClassName());
                item.setCount(jdcheckResultDetails.get(i).getLong("count(*)"));
                jdcheckScanDetails.add(item);
            }
