                if ("ios".equals(projectModuleInfo.getPlatform())) {
                    if (projectModuleInfo.getAppid() == 1) {
                        jenkinsmoduleName = ServerConfig.IOS_JDAPP_MODULE;
                    } else {
                        jenkinsmoduleName = ServerConfig.IOS_COMMEN_MODULE;

                    }
                }
                BuildResult buildResult = null;
                try {
                    buildResult = JenkinsControl.getInstance().get_build_result(jenkinsmoduleName, jdcheckHistory.getJobNum(), jdcheckHistory.getJenkins());
                }catch (Exception e){
                    buildResult=null;
                }
//                BuildResult buildResult = BuildResult.BUILDING;

                if (buildResult == BuildResult.SUCCESS) {
                    //这个只是jenkins的扫描成功结束并不代表infer的扫描成功，如果inferHistory中没成功，而jenkins成功了 则是失败。
                    state = -1;
                } else if (buildResult == BuildResult.BUILDING || buildResult == BuildResult.REBUILDING) {
                    state = 1;
                } else if (buildResult == BuildResult.NOT_BUILT) {
                    state = 0;
                } else if (buildResult == null) {
                    state = state;
                } else {
                    state = -1;
                }
                jdcheckHistory = JdcheckHistory.dao.findByIdWithOutLog(id);
                if (jdcheckHistory != null) {
                    if (jdcheckHistory.getJobState() != 2) {
                        jdcheckHistory.setJobState(state);

                        if (jdcheckHistory.getJobState() == -1) {
                            String log = JenkinsControl.getInstance().getBuildLog(projectModuleInfo.getJenkinsJobName(), jdcheckHistory.getJobNum(), jdcheckHistory.getJenkins());
                            if (!StringUtil.isEmpty(log)) {
                                jdcheckHistory.setLog(log);
                                jdcheckHistory.setJobErrorReason(ErrorLogReasonUtil.getErrorReason(log, this));
                            }
                        }
                        jdcheckHistory.update();
                    }
                    renderJson(new BaseResponseBean<JdCheckHistoryDetail>(JdCheckHistoryDetail.dao.findById(id)));
                } else {
                    JdCheckHistoryDetail jdCheckHistoryDetail = new JdCheckHistoryDetail();
                    jdCheckHistoryDetail.setJobState(state);
                    renderJson(new BaseResponseBean<JdCheckHistoryDetail>(jdCheckHistoryDetail));
                }
            }
        } else {
            renderJson(new BaseResponseBean(-1, "JdCheck扫描未创建!"));
        }
