    @ActionKey("/me/module/action_update_moduleinfo")
    public void updateModuleInfo() {
        Integer moduleId = getParaToInt("module_id", null);
        String moduleCn = getPara("module_cn", null);
        String branch = getPara("branch", null);
        String platform = getPara("platform", null);
        String git = getPara("git_url", null);
        String desc = getPara("desc", null);
        String appGroup = getPara("appGroup_id", "");
        String outReaon = getPara("outReason", "");
        int appName = getParaToInt("appName_id", 0);


        if (moduleId == null || StringUtil.isEmpty(branch) || StringUtil.isEmpty(moduleCn) || StringUtil.isEmpty(platform) || StringUtil.isEmpty(git) || StringUtil.isEmpty(appGroup)) {
            renderJson(new BaseResponseBean(-1, "缺少必要参数"));
            return;
        }

        String regex = "git@([\\w-]+\\.)+[\\w-]+(\\:[\\w- .\\/?%&=]*)?.git";
        if (git.trim().matches(regex)) {
            String oldStr = git.trim().substring(0, git.indexOf(":") + 1);
            String newStr = "http://" + git.trim().substring(4, git.trim().indexOf(":")) + "/";
            git = git.replace(oldStr, newStr);
        }

        if (appName == 0) {
            appName = ProjectModuleApp.dao.selectAppGroupIsNone(appGroup);
            if (appName == -1) {
                renderJson(new BaseResponseBean(-1, "请选择应用分类"));
                return;
            }
        }
        if (!platform.equals("android") && !platform.equals("java")) {
            renderJson(new BaseResponseBean(-1, "参数错误"));
            return;
        }
        ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.findById(moduleId);
        if (projectModuleInfo == null) {
            renderJson(new BaseResponseBean(-2, "工程不存在"));
            return;
        }


        projectModuleInfo.setOutreason(outReaon);
        projectModuleInfo.setAppid(appName);
        projectModuleInfo.setModuleCn(moduleCn.trim());
        projectModuleInfo.setBranch(branch.trim());
        projectModuleInfo.setPlatform(platform.trim());
        projectModuleInfo.setDesc(desc == null ? null : desc.trim());

        //分布式集成方案
        if (!projectModuleInfo.getGitUrl().equals(git.trim())) {
            if (ProjectModuleInfo.dao.isExits(projectModuleInfo.getProjectId(), git.trim())) {
                renderJson(new BaseResponseBean(-2, "在该项目下，该Git地址所在的工程已存在！"));
                return;
            }
            boolean isResult = false;
            if (GitMemberUtil.checkCommenUserPermission(git.trim())) {
                String storageGitUrl = git.trim();
//                if (storageGitUrl.contains("gitlab.ctrlle.com")) {
//                    storageGitUrl = storageGitUrl.replace("http://gitlab.ctrlle.com/", "git@gitlab.ctrlle.com:");
//                }
                List<String> newJenkins = Jenkins.dao.getJenkinsUrlByModuleId(projectModuleInfo.getId());

                if (JenkinsControl.getInstance().isExist(projectModuleInfo.getJenkinsJobName(), newJenkins.get(0))) {
                    //注意不能删除工程，否则新建后出发任务默认为构建结果已存在，结果无法上传
                    String userId = Jenkins.dao.getUserIdByJenkinsUrl(newJenkins.get(0), git);

                    isResult = JenkinsControl.getInstance().updateUrl(projectModuleInfo.getJenkinsJobName(), storageGitUrl, userId, Jenkins.dao.getJenkinsUrlByModuleId(projectModuleInfo.getId()));
