            if (!isResult) {
                renderJson(new BaseResponseBean(-2, "Git地址修改错误！"));
                return;
            }
            projectModuleInfo.setGitUrl(git.trim());

        }

        //原有git方案
        projectModuleInfo.update();

        renderJson(new BaseResponseBean<ProjectModuleInfo>(projectModuleInfo));
    }

    @ActionKey("/me/module/action_delete_module")
    public void deleteModule() {
        Integer moduleId = getParaToInt("module_id", null);
        if (moduleId == null) {
            renderJson(new BaseResponseBean(-1, "缺少必要参数"));
            return;
        }
        ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.findById(moduleId);
        if (projectModuleInfo == null) {
