            return;
        }
        if (ProjectModuleUser.dao.canEdit(projectModuleInfo.getProjectId(), moduleId, LoginUtil.getUserName(this))) {
            List<JdcheckResult> jdcheckResults = JdcheckResult.dao.find("select * from jdcheck_result where jdcheck_result.id in (select jdcheck_history.result_id from jdcheck_history where jdcheck_history.module_id=?)", moduleId);
