                for (int i = 0; i < jdcheckHistories.size(); i++) {
                    jdcheckHistories.get(i).delete();
                }
            }
            List<ProjectModuleUser> projectModuleUsers = ProjectModuleUser.dao.find("select * from project_module_user where module_id=?", moduleId);
            if (projectModuleUsers != null && projectModuleUsers.size() > 0) {
                for (int i = 0; i < projectModuleUsers.size(); i++) {
                    projectModuleUsers.get(i).delete();
                }
            }
            ProjectModuleInfo.dao.deleteById(moduleId);
            JenkinsControl.getInstance().deleteJob(projectModuleInfo.getJenkinsJobName(), Jenkins.dao.getJenkinsUrlByModuleId(moduleId));
            renderJson(new BaseResponseBean());
        } else {
            renderJson(new BaseResponseBean(-2, "您没有权限删除该工程"));
        }
    }

    @ActionKey("/me/module/action_get_ruleset")
    public void getModuleRuleSet() {
        Integer moduleId = getParaToInt("module_id", null);
        if (moduleId == null) {
            renderJson(new BaseResponseBean(-1, "缺少必要参数"));
            return;
        }
        ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.findById(moduleId);
        if (projectModuleInfo == null) {
            renderJson(new BaseResponseBean(-1, "该工程不存在"));
            return;
        }
        List<JdcheckRule> datas = JdcheckRule.dao.getChoiceRules(projectModuleInfo);
        List<JdCheckRuleBean> result = new ArrayList<>();
        if (datas != null && datas.size() > 0) {
            for (JdcheckRule item : datas) {
                if (!StringUtil.isEmpty(item.getDescription())) {
                    item.setDescription(StringEscapeUtils.escapeHtml(item.getDescription()));
                }
                if (!StringUtil.isEmpty(item.getBrief())) {
                    item.setBrief(StringEscapeUtils.escapeHtml(item.getBrief()));
                }
                if (!StringUtil.isEmpty(item.getExample())) {
                    item.setExample(StringEscapeUtils.escapeHtml(item.getExample()));
                }
                boolean isAdd = false;
                for (int i = 0; i < result.size(); i++) {
                    if (item.getRuleType().equals(result.get(i).getType())) {
                        isAdd = true;
                        result.get(i).getRules().add(item);
                    }
                }
                if (!isAdd) {
                    JdCheckRuleBean temp = new JdCheckRuleBean();
                    temp.setType(item.getRuleType());
                    temp.getRules().add(item);
                    result.add(temp);
                }
            }
        }
        renderJson(JSON.toJSON(new BaseResponseBean<List<JdCheckRuleBean>>(result)));
    }

