    @ActionKey("/me/module/action_update_emailStatus")
    public void changeEmialSwitchStatus() {
        Integer emailStatus = getParaToInt("email_status", null);
        Integer moduleId = getParaToInt("module_id", null); //筛选条件
        Integer projectId = getParaToInt("project_id", null);
        if (emailStatus == null || moduleId == null || projectId == null) {
            renderJson(new BaseResponseBean(-1, "缺少必要参数"));
            return;
        }
        boolean isHavePremission = ProjectModuleUser.dao.canEdit(projectId, moduleId, LoginUtil.getUserName(this));
        if (isHavePremission == false) {
            renderJson(new BaseResponseBean(-2, "您没有权限操作"));
            return;
        }
        boolean isUpdateSuccess = EmailSwitch.dao.updateModuleEmailStatus(moduleId, emailStatus, LoginUtil.getUserName(this));
        if (isUpdateSuccess == false) {
            renderJson(new BaseResponseBean(-3, "邮件状态修改失败"));
            return;
        }
        try {
            List<ProjectModuleUser> list = ProjectModuleUser.dao.getUserByModuleId(moduleId);
            String emailList = "";
            if (list != null && list.size() > 0) {
                for (int i = 0; i < list.size(); i++) {
                    String email = list.get(i).getEmail();
                    if (TextUtils.isEmpty(emailList)) {
                        emailList = email;
                    } else {
                        emailList = emailList + ";" + email;
                    }

                }

            }
            String jobName = "";
            ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.getProjectModuleInfoById(moduleId);
            if (projectModuleInfo != null) {
                jobName = projectModuleInfo.getModuleEn() + "(" + projectModuleInfo.getModuleCn() + ")";
            }

            String status = "";
            if (emailStatus == 0) {
                status = "开";
            } else {
                status = "关";
            }


            String updateErp = EmailSwitch.dao.getEmailUser(moduleId);

            Map<String, String> params = new HashMap<>();
            params.put("recipientList", emailList);
            params.put("jobName", jobName);
            params.put("status", status);
            params.put("updateErp", updateErp);
            String jenkinsUrl = Jenkins.dao.getJenkinsUrlByModuleId(moduleId).get(0);
            System.out.println(jenkinsUrl);
            if (JenkinsControl.getInstance().isExist(ServerConfig.jenkins_email_jobname, jenkinsUrl)) {
                JenkinsControl.getInstance().buildJob(jenkinsUrl, ServerConfig.jenkins_email_jobname, params);
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
        renderJson(new BaseResponseBean());
    }


