    @ActionKey("/me/module/action_update_sdkconfig")
    public void updateSDKConfig() {
        Integer moduleId = getParaToInt("module_id", null); //筛选条件
        if (moduleId == null) {
            renderJson(new BaseResponseBean(-1, "缺少module_id参数"));
            return;
        }
        ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.findById(moduleId);
        if (projectModuleInfo == null) {
            renderJson(new BaseResponseBean(-1, "module_id对应的数据不存在"));
            return;
        }
        if (!ProjectModuleUser.dao.canEdit(projectModuleInfo.getProjectId(), projectModuleInfo.getId(), LoginUtil.getUserName(this))) {
            renderJson(new BaseResponseBean(-2, "没有权限修改"));
            return;
        }
        Integer duplicatetoken = getParaToInt("duplicatetoken");
        if (duplicatetoken == null) {
            renderJson(new BaseResponseBean(-1, "重复代码字符数不能为空"));
            return;
        }
        if (duplicatetoken < 3) {
            renderJson(new BaseResponseBean(-1, "重复代码字符数>=3"));
            return;
        }
        Integer blockmin = getParaToInt("blockmin");
        if (blockmin == null) {
            renderJson(new BaseResponseBean(-1, "block不能为空"));
            return;
        }
        Integer criticalmin = getParaToInt("criticalmin");
        if (criticalmin == null) {
            renderJson(new BaseResponseBean(-1, "critical不能为空"));
            return;
        }
        Integer majormin = getParaToInt("majormin");
        if (majormin == null) {
            renderJson(new BaseResponseBean(-1, "major不能为空"));
            return;
        }
        Integer warningmin = getParaToInt("warningmin");
        if (warningmin == null) {
            renderJson(new BaseResponseBean(-1, "warning不能为空"));
            return;
        }
        if (warningmin < 3) {
            renderJson(new BaseResponseBean(-1, "warning>=3"));
            return;
        }
        if (majormin <= warningmin) {
            renderJson(new BaseResponseBean(-1, "major>=warning"));
            return;
        }
        if (criticalmin <= majormin) {
            renderJson(new BaseResponseBean(-1, "critical>=major"));
            return;
        }
        if (blockmin <= criticalmin) {
            renderJson(new BaseResponseBean(-1, "block>=critical"));
            return;
        }
        ProjectModuleConfig projectModuleConfig = ProjectModuleConfig.dao.findById(moduleId);
        boolean isExist = true;
        if (projectModuleConfig == null) {
            isExist = false;
            projectModuleConfig = new ProjectModuleConfig();
            projectModuleConfig.setModuleid(moduleId);
        }
        projectModuleConfig.setDuplicatetoken(duplicatetoken);
        projectModuleConfig.setWarningmin(warningmin);
        projectModuleConfig.setMajormin(majormin);
        projectModuleConfig.setCriticalmin(criticalmin);
        projectModuleConfig.setBlockmin(blockmin);
        projectModuleConfig.setModuleid(moduleId);
        if (isExist) {
            projectModuleConfig.update();
        } else {
            projectModuleConfig.save();
        }
        renderJson(new BaseResponseBean<Object>(JSON.toJSON(projectModuleConfig)));
    }

    @ActionKey("/me/module/origainzationIsChange")
    public void origainzationIsChange() {

        String userName = getPara("userName", null);
        Integer projectId = getParaToInt("projectId", null);
        Integer moduleId = getParaToInt("moduleId", null);

        if (TextUtils.isEmpty(userName) || projectId == null || moduleId == null) {
            renderJson(new BaseResponseBean(-1, "上传参数有误!"));
            return;
        }
        String erp = userName.substring(userName.indexOf("(") + 1, userName.length() - 1);

        String oldOrigainzation = Project.dao.findById(projectId).getName();
        String newOrigainzation = "";
        if (!TextUtils.isEmpty(LoginUtil.getOrganizationFullName(erp))) {
            newOrigainzation = LoginUtil.getOrganizationFullName(erp);

            if (newOrigainzation.equals(oldOrigainzation.substring(0, oldOrigainzation.lastIndexOf("(")))) {
                newOrigainzation = oldOrigainzation;
            } else {
                List<Project> list = Project.dao.find("select * from project where name like '" + newOrigainzation + "(%'");

                if (list != null && list.size() > 0) {
                    Project project = list.get(0);
                    newOrigainzation = project.getName();
                } else {
                    if (LoginUtil.getLeaderInfo(erp) != null) {
                        String leaderName = LoginUtil.getLeaderInfo(erp).getRealName();
                        if (!TextUtils.isEmpty(leaderName)) {
                            newOrigainzation = newOrigainzation + "(" + leaderName + ")";
                        }
                    }
                }
            }
        }
        if (oldOrigainzation.equals(newOrigainzation)) {
            //判断是否在user表中
            List<ProjectModuleUser> list = ProjectModuleUser.dao.find("select * from project_module_user where module_id=? and erp=?", moduleId, erp);
            if (list != null && list.size() > 0) {
                ProjectModuleUser user = list.get(0);
                //2
                //判断是不是负责人，如果不是，就设置成负责人，并且修改原来的负责人
                if (!ProjectModuleUser.dao.getIsOwnerByModuleErp(moduleId, erp)) {
                    ProjectModuleUser projectModuleUser = ProjectModuleUser.dao.getOwnerByModuleId(moduleId);
                    if (projectModuleUser != null) {
                        projectModuleUser.setJoinerp(null);
                        projectModuleUser.update();
                    }
                    user.setJoinerp("1");
                    user.update();

                }


            }
            //用户在观察员列表，新增到user表，并将user表原来的负责人修改
            else {
                ProjectModuleUser user = ProjectModuleUser.dao.getOwnerByModuleId(moduleId);
                if (user != null) {
                    user.setJoinerp(null);
                    user.update();
                }

                ProjectModuleUser projectModuleUser = new ProjectModuleUser();
                AccountInfoBean accountInfoBean = LoginUtil.getUserInfoDetail(erp);
                if (accountInfoBean != null) {
                    projectModuleUser.setErp(erp);
                    projectModuleUser.setModuleId(moduleId);
                    projectModuleUser.setEmail(accountInfoBean.getEmail());
                    projectModuleUser.setUsername(accountInfoBean.getRealName());
                    projectModuleUser.setLevel(3);
                    projectModuleUser.setJoinerp("1");
                    projectModuleUser.save();
                }

            }


        }


        renderJson(new BaseResponseBean<String>(newOrigainzation));


    }


