    @ActionKey("me/module/action_build_job")
    public void buildJob() {
        int moduleId = getParaToInt("module_id", -1);
        if (moduleId < 0) {
            renderJson(new BaseResponseBean(-1, "请输入正确的module_info_id"));
            return;
        }
        ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.findById(moduleId);
        if (projectModuleInfo == null) {
            renderJson(new BaseResponseBean(-1, "请输入正确的module_info_id"));
            return;
        }
        String erp = LoginUtil.getUserName(this);
        if (!ProjectModuleUser.dao.canBuildJob(projectModuleInfo.getProjectId(), moduleId, erp)) {
            renderJson(new BaseResponseBean(-2, "您没有权限手动触发该扫描!"));
            return;
        }
        String jenkinsUrl = Jenkins.dao.getJenkinsUrlByProjectId(projectModuleInfo.getProjectId(), projectModuleInfo.getGitUrl(), projectModuleInfo.getPlatform()).get(0);
        int jobNum = 0;
        List<String> list=JenkinsControl.getInstance().getBuildingJobs(jenkinsUrl);
        List<String> queueList=JenkinsControl.getInstance().get_queue_jobs(jenkinsUrl);

        if (projectModuleInfo.getPlatform().equals("ios")) {
            String jenkinsModuleName = ServerConfig.IOS_COMMEN_MODULE;
            Map<String, String> params = new HashMap<>();
            String iosGitUrl = projectModuleInfo.getGitUrl().substring(7, projectModuleInfo.getGitUrl().length());
            params.put("gitUrl", iosGitUrl);
            params.put("platform", projectModuleInfo.getPlatform().trim());
            params.put("recipientList", LoginUtil.getUserEmail(this));
            params.put("errorEmail", JobConfigUtil.error_Email);
            params.put("branch", projectModuleInfo.getBranch().trim());
            params.put("moduleId", projectModuleInfo.getJenkinsJobName());
            params.put("moduleName", projectModuleInfo.getModuleEn());
            params.put("appId", String.valueOf(projectModuleInfo.getAppid()));
            params.put("qualityTool", "eos");
            // 代表京东商城ios客户端
            if (projectModuleInfo.getAppid() == 1) {
                jenkinsModuleName = ServerConfig.IOS_JDAPP_MODULE;
            }

            jobNum = JenkinsControl.getInstance().buildJob(jenkinsUrl, jenkinsModuleName, params);
        } else {
            if(list!=null&&list.size()>0){
                for(String jobName:list){
                    if(jobName.trim().equals(projectModuleInfo.getJenkinsJobName().trim())){
                        renderJson(new BaseResponseBean(-1,"该工程正在构建中，请完成后再试!"));
                        return;
                    }
                }
            }
            if(queueList!=null&&queueList.size()>0){
                for(String jobName:queueList){
                    if(jobName.equals(projectModuleInfo.getJenkinsJobName())){
                        renderJson(new BaseResponseBean(-1,"该工程正在排队，请完成后再试!"));
                        return;
                    }
                }
            }
            jobNum = JenkinsControl.getInstance().buildJob(projectModuleInfo.getJenkinsJobName(), projectModuleInfo.getBranch(), LoginUtil.getUserEmail(this), jenkinsUrl, projectModuleInfo.getPlatform(), JobConfigUtil.error_Email, "eos");

        }

        if (jobNum > 0) {
            if (JdcheckHistory.dao.checkIsExist(moduleId, jobNum, jenkinsUrl) != null) {
                renderJson(new BaseResponseBean(-4, "该条jdcheck任务已经创建"));
                return;
            }
            JdcheckHistory jdcheckHistory = new JdcheckHistory(jobNum, moduleId, LoginUtil.getUserName(this), LoginUtil.getFullName(this), LoginUtil.getUserEmail(this), projectModuleInfo.getBranch(), new Date(System.currentTimeMillis()), jenkinsUrl, 0, null);
            jdcheckHistory.save();
            renderJson(new BaseResponseBean(null));
        } else {
            renderJson(new BaseResponseBean(-3, "jdcheck扫描任务创建失败"));
        }
