    private void analysisModuleData(int projectId, Calendar curCalendar, int durTime, Integer choice) {
        String platform = getPara("platform", "all");
        long tempA = System.currentTimeMillis();
        if ("all".equals(platform)) {
            platform = null;
        }
        List<JdCheckAnalyBean> datas = JdCheckAnalyModel.dao.getMyWatchModuleAnalyDatas(curCalendar.getTimeInMillis(), durTime, LoginUtil.getUserName(this), projectId, choice, false, platform);
        for (int i = 0; i < datas.size(); i++) {
            int las = datas.get(i).getNum().size() - 1;
            int tempIndex = i;
            for (int j = i; j < datas.size(); j++) {
                if (datas.get(tempIndex).getOuttime() == null) {
                    if (datas.get(j).getOuttime() == null) {
                        if (datas.get(j).getNum().get(las) != null) {
                            if (datas.get(tempIndex).getNum().get(las) != null && datas.get(j).getNum().get(las).intValue() > datas.get(tempIndex).getNum().get(las).intValue()) {
                                tempIndex = j;
                            } else if (datas.get(tempIndex).getNum().get(las) == null) {
                                tempIndex = j;
                            }
                        }
                    }
                } else {
                    tempIndex = j;
                }
            }
            JdCheckAnalyBean temp = datas.get(tempIndex);
            datas.set(tempIndex, datas.get(i));
            datas.set(i, temp);
        }
        long tempB = System.currentTimeMillis();
        SQLexcuteTime.instance.addNew(getRequest().getRequestURL().toString(), tempA, tempB - tempA);
        renderJson(new BaseResponseBean<List<JdCheckAnalyBean>>(datas));
