    public static List<MonthCutDataBean> sortList(List<MonthCutDataBean> list) {
        if (list == null || list.size() < 0) {
            return list;
        }


        Collections.sort(list, new Comparator<MonthCutDataBean>() {

            /*
             * int compare(Question o1, Question o2) 返回一个基本类型的整型，
             * 返回负数表示：o1 小于o2，
             * 返回0 表示：o1和o2相等，
             * 返回正数表示：o1大于o2。
             */
            public int compare(MonthCutDataBean bean1, MonthCutDataBean bean2) {
                if (bean1.getCut() == null || bean2.getCut() == null) {
                    return 0;
                }

                //按照学生的年龄进行升序排列
                if (bean1.getCut() > bean2.getCut()) {
                    return -1;
                }
                if (bean1.getCut() == bean2.getCut()) {
                    return 0;
                }
                return 1;
            }

        });
        return list;
    }


    public static String getPercent(int y, int z) {
        String result = "";
        try {
            float num = y / (float) z;
            DecimalFormat df = new DecimalFormat("0.00%");//格式化小数
            result = df.format(num);//返回的是String类型
        } catch (Exception e) {
            e.printStackTrace();
        }
        return result;

    }

