    @ActionKey("me/pinfo/action_delete_watcher")
    public void deleteWatcher() {
        Integer watcherId = getParaToInt("watcher_id", null);
        Integer projectId = getParaToInt("project_id", null);
        if (watcherId == null || projectId == null) {
            renderJson(new BaseResponseBean(-1, "请上传必要参数"));
            return;
        }
        if (ProjectWatcher.dao.canEdit(projectId, LoginUtil.getUserName(this))) {
            ProjectWatcher.dao.deleteById(watcherId);
            renderJson(new BaseResponseBean());
        } else {
            renderJson(new BaseResponseBean(-2, "您没有权限移除数据观察者"));
        }
    }

    @ActionKey("me/pinfo/action_add_watcher")
    public void addWatcher() {
        Integer projectId = getParaToInt("project_id", null);
        String erp = getPara("erp",null);
        if(projectId==null || StringUtil.isEmpty(erp)){
            renderJson(new BaseResponseBean(-1, "请上传必要参数"));
            return ;
        }
        if(ProjectWatcher.dao.canEdit(projectId, LoginUtil.getUserName(this))){
            if(ProjectWatcher.dao.isExistInWatcher(projectId,erp.trim())){
                renderJson(new BaseResponseBean(1, "已经存在!"));
            }else{
                ProjectWatcher projectWatcher = new ProjectWatcher();
                projectWatcher.setProjectId(projectId);
                projectWatcher.setErp(erp.trim());
                String userName = "";
                String email = "";
                AccountInfoBean accountInfoBean = LoginUtil.getUserInfoDetail(erp);
                if (accountInfoBean != null) {
                    if (!TextUtils.isEmpty(accountInfoBean.getRealName())) {
                        userName = accountInfoBean.getRealName();
                    }
                    if (!TextUtils.isEmpty(accountInfoBean.getEmail())) {
                        email = accountInfoBean.getEmail();
                    }
                }
                if (!TextUtils.isEmpty(userName) && !TextUtils.isEmpty(email)) {
                    projectWatcher.setUsername(userName);
                    projectWatcher.setEmail(email);
                } else {
                    renderJson(new BaseResponseBean(-1, "查无此人"));
                    return;
                }
                projectWatcher.save();
                renderJson(new BaseResponseBean<ProjectWatcher>(projectWatcher));
            }
        }else{
            renderJson(new BaseResponseBean(-2, "您没有权限移除数据观察者"));
        }
    }

    @ActionKey("/me/pinfo/getUserInfobyErp")
