        String erp = getPara("erp", null);
        if (StringUtil.isEmpty(StringUtil.getNoTrimString(erp))) {
            renderJson(new BaseResponseBean(-1, "输入为空"));
            return;
        }
        AccountInfoBean accountInfoBean = LoginUtil.getUserInfoDetail(erp);
        if (accountInfoBean != null) {
            if (TextUtils.isEmpty(accountInfoBean.getRealName()) || TextUtils.isEmpty(accountInfoBean.getEmail())) {
                renderJson(new BaseResponseBean(-2, "添加失败"));
            } else {
                renderJson(new BaseResponseBean<AccountInfoBean>(accountInfoBean));
            }
        } else {
            renderJson(new BaseResponseBean(-2, "查无此人"));

        }


    }
