    /**
     * 修改自己的自定义规则信息
     */
    @ActionKey("me/rule/action_update_myruleinfo")
    public void updateMyRuleInfo(){
        String moduleIds = getPara("moduleIds",null);
        String jdcheckRuleST = getPara("jdcheckRule",null);
        if(jdcheckRuleST == null){
            renderJson(new BaseResponseBean(-2,"请上传jdcheckRule"));
            return ;
        }
        JSONObject jsonObject = JSONObject.parseObject(jdcheckRuleST);
        if(jsonObject == null){
            renderJson(new BaseResponseBean(-2,"请上传jdcheckRule"));
            return ;
        }
        JdcheckRule jdcheckRule = JdcheckRule.dao.findById(jsonObject.getIntValue("id"));
        if(jdcheckRule == null){
            renderJson(new BaseResponseBean(-2,"请上传jdcheckRule"));
            return ;
        }
        jdcheckRule.setPlatform(jsonObject.getString("platform"));
        jdcheckRule.setRuleName(jsonObject.getString("rule_name"));
        jdcheckRule.setErrorLevel(jsonObject.getString("error_level"));
        jdcheckRule.setBrief(jsonObject.getString("brief"));
        jdcheckRule.setExample(jsonObject.getString("example"));

        if(jdcheckRule.getFromJarId()==null){
            renderJson(new BaseResponseBean(-2,"缺少from_jar_id"));
            return ;
        }
        if(StringUtil.isEmpty(jdcheckRule.getRuleType())){
            renderJson(new BaseResponseBean(-1,"rule_type不能为空"));
            return ;
        }
        if(StringUtil.isEmpty(jdcheckRule.getErrorLevel())){
            renderJson(new BaseResponseBean(-1,"error_level不能为空"));
            return ;
        }
        if(StringUtil.isEmpty(jdcheckRule.getRuleName())){
            renderJson(new BaseResponseBean(-1,"rule_name不能为空"));
            return ;
        }
        if(StringUtil.isEmpty(jdcheckRule.getPlatform())){
            renderJson(new BaseResponseBean(-1,"platform不能为空"));
            return ;
        }
        String te = jdcheckRule.getPlatform();
        if(te.startsWith("/")){
            te = te.substring(1);
        }
        if(te.endsWith("/")){
            te = te.substring(0,te.length()-1);
        }
        jdcheckRule.setPlatform(te);

        if(StringUtil.isEmpty(jdcheckRule.getBrief())){
            renderJson(new BaseResponseBean(-1,"brief不能为空"));
            return ;
        }
        jdcheckRule.update();

        if(StringUtil.isEmpty(moduleIds)){
            List<JdcheckRuleset> temps = JdcheckRuleset.dao.find("select * from jdcheck_ruleset where rule_id = ?",jdcheckRule.getId());
            if(temps!=null && temps.size()>0){
                for(JdcheckRuleset i:temps){
                    i.delete();
                }
            }
        }else{
            List<JdcheckRuleset> temps = JdcheckRuleset.dao.find("select * from jdcheck_ruleset where rule_id = ?",jdcheckRule.getId());
            List<String> modulelistS = Arrays.asList(moduleIds.split("/"));
            List<Integer> modulelist = new ArrayList<>();
            if(modulelistS!=null && modulelistS.size()>0){
                for(String item :modulelistS){
                    try{
                        if(!StringUtil.isEmpty(item)){
                            int t = Integer.parseInt(item);
                            modulelist.add(t);
                        }
                    }catch (Exception e){

                    }
                }
            }
            if(temps!=null && temps.size()>0){
                for(int i=0;i<temps.size();i++){
                    boolean isExist = false;
                    for(int j=0;j<modulelist.size();j++){
                        if(temps.get(i).getRuleId().intValue()==modulelist.get(j).intValue()){
                            isExist = true;
                            modulelist.remove(j);
                            break;
                        }
                    }
                    if(!isExist){
                        temps.get(i).delete();
                    }
                }
            }
            if(modulelist.size()>0){
                for(Integer t:modulelist){
                    JdcheckRuleset jd = new JdcheckRuleset();
                    jd.setRuleId(jdcheckRule.getId());
                    jd.setModuleId(t);
                    jd.setSelect(0);
                    jd.save();
                }
            }
        }
        renderJson(new BaseResponseBean<JdcheckRule>(jdcheckRule));
    }


