    @ActionKey("me/rule/action_update_file")
    public void updateFile(){
        UploadFile file = null;
        try{
            file = getFile();
            Integer id = getParaToInt("id",null);
            if(id==null){
                file.getFile().deleteOnExit();
                renderJson(new BaseResponseBean(-1,"缺少id"));
                return ;
            }
            JdcheckRuleJar jdcheckRuleJar = JdcheckRuleJar.dao.findById(id);
            if(jdcheckRuleJar==null){
                file.getFile().deleteOnExit();
                renderJson(new BaseResponseBean(-1,"该条规则文件不存在"));
                return ;
            }
            String version = getPara("version",null);
            if(StringUtil.isEmpty(version)||version.equals(jdcheckRuleJar.getRuleSetVersion())){
                file.getFile().deleteOnExit();
                renderJson(new BaseResponseBean(-1,"版本号有问题"));
                return ;
            }
            jdcheckRuleJar.setRuleSetVersion(version);
            /*
            提交文件到云存储返回jar包下载地址
             */
            String suffix = file.getOriginalFileName().substring(file.getOriginalFileName().lastIndexOf(".") + 1);
            String newFileName = MBase64.encode(UUID.randomUUID().toString()+UUID.randomUUID().toString(),"utf-8")+"."+suffix;
            JdS3Client.uploadObject(jarBucketName,newFileName,file.getFile());
//            String md5 = JdClient.getInstance().getNewClient().bucket(jarBucketName).object(newFileName).entity(file.getFile()).put();
            String downloadUrl = ENDPOINT+"/"+jarBucketName+"/"+newFileName;
            jdcheckRuleJar.setUrl(downloadUrl);
            jdcheckRuleJar.update();
            file.getFile().deleteOnExit(); //上传后删除
            renderJson(new BaseResponseBean<JdcheckRuleJar>(jdcheckRuleJar));
        } catch (Exception e){
            e.printStackTrace();

            renderJson(new BaseResponseBean(-1,"文件上传失败"));
        } finally {
            if(file!=null && file.getFile()!=null){
                file.getFile().deleteOnExit();
            }
        }
    }

    @ActionKey("me/rule/action_analyrulejar")
