                            List<ProjectModuleInfo> moduleInfos = ProjectModuleInfo.dao.find("select project_module_info.* from project_module_info,jdcheck_ruleset where jdcheck_ruleset.module_id = project_module_info.id and jdcheck_ruleset.rule_id=?",originRules.get(i).getId());
                            if(moduleInfos==null){
