    @ActionKey("me/rule/action_add_new_rule")
    public void addNewRule(){
        UploadFile file = getFile();
        try{
            String action = getPara("action","new");
            //Jar包版本号
            String fileVersion = getPara("fileVersion",null);
            if(StringUtil.isEmpty(fileVersion) || fileVersion.trim().length()==0){
                renderJson(new BaseResponseBean(-1,"请提交Jar包版本号"));
                return ;
            }
            String data = getPara("data",null);
            if(StringUtil.isEmpty(data)){
                renderJson(new BaseResponseBean(-1,"缺少data"));
                return ;
            }

            if(action.equals("new")){
                //Jar包文件名
                String fileName = getPara("fileName",null);
                if(StringUtil.isEmpty(fileName) || fileName.trim().length()==0){
                    renderJson(new BaseResponseBean(-1,"请提交Jar文件名"));
                    return ;
                }
                if(JdcheckRuleJar.dao.isExistFileName(fileName)){
                    renderJson(new BaseResponseBean(-1,"Jar文件名已存在，请修改"));
                    return ;
                }

                //添加新增规则
                JSONArray datas = JSON.parseArray(data);
                if(datas==null || datas.size()==0){
                    renderJson(new BaseResponseBean(-1,"该jar包无规则或data数据解析失败"));
                    return ;
                }
                //提交文件到云存储返回jar包下载地址
                String suffix = file.getOriginalFileName().substring(file.getOriginalFileName().lastIndexOf(".") + 1);
                String newFileName = MBase64.encode(UUID.randomUUID().toString()+UUID.randomUUID().toString(),"utf-8")+"."+suffix;
                try{
                    JdS3Client.uploadObject(jarBucketName,newFileName,file.getFile());
//            String md5 = JdClient.getInstance().getNewClient().bucket(jarBucketName).object(newFileName).entity(file.getFile()).put();
                }catch (Exception e){
                    if(file!=null && file.getFile()!=null){
                        file.getFile().deleteOnExit();
                    }
                    renderJson(new BaseResponseBean(-1,"规则文件上传失败"));
                    return ;
                }

                String downloadUrl = ENDPOINT+"/"+jarBucketName+"/"+newFileName;
                JdcheckRuleJar jdcheckRuleJar = new JdcheckRuleJar();
                jdcheckRuleJar.setUrl(downloadUrl);
                jdcheckRuleJar.setFileName(fileName);
                jdcheckRuleJar.setRuleSetVersion(fileVersion);
                jdcheckRuleJar.save();

                int saveCount = 0;
                for(int i=0;i<datas.size();i++){
                    if(datas.getJSONObject(i).getBoolean("select") && !datas.getJSONObject(i).getBoolean("exist")){
                        if(!JdcheckRule.dao.isExistRuleName(datas.getJSONObject(i).getString("rule_name"))){
                            saveCount ++;
                            JdcheckRule jdcheckRule = JSON.parseObject(datas.getJSONObject(i).getString("jdcheckRule"),JdcheckRule.class);
                            String platforms = jdcheckRule.getPlatform();
                            if(platforms==null){
                                platforms = "";
                            }
                            if(platforms.startsWith("/")){
                                platforms = platforms.substring(1);
                            }
                            if(platforms.endsWith("/")){
                                platforms = platforms.substring(0,platforms.length()-1);
                            }
                            jdcheckRule.setFromJarId(jdcheckRuleJar.getId());
                            jdcheckRule.setPlatform(platforms);
                            jdcheckRule.save();

                            //可适用moduleIds
                            String moduleIdString = datas.getJSONObject(i).getString("modules");
                            if(!StringUtil.isEmpty(moduleIdString)){
                                String[] temps = moduleIdString.split("/");
                                if(temps!=null && temps.length>0){
                                    for(int j=0;j<temps.length;j++){
                                        if(temps[j]!=null && temps[j].length()>0){
                                            try{
                                                int a = Integer.parseInt(temps[j]);
                                                JdcheckRuleset jdcheckRuleset = new JdcheckRuleset();
                                                jdcheckRuleset.setSelect(0);
                                                jdcheckRuleset.setRuleId(jdcheckRule.getId());
                                                jdcheckRuleset.setModuleId(a);
                                                jdcheckRuleset.save();
                                            }catch (Exception e){
                                                e.printStackTrace();
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                }
                if(saveCount==0){
                    jdcheckRuleJar.delete();
                    renderJson(new BaseResponseBean(-1,"提交失败，没有可用规则"));
                }else{
                    renderJson(new BaseResponseBean());
                }
            }else{
                Integer jarId = getParaToInt("jarId",null);
                if(jarId==null){
                    renderJson(new BaseResponseBean(-1,"Jarid未上传"));
                    return ;
                }
                JdcheckRuleJar jdcheckRuleJar = JdcheckRuleJar.dao.findById(jarId);
                if(jdcheckRuleJar==null){
                    renderJson(new BaseResponseBean(-1,"Jarid不存在"));
                    return ;
                }
                if(jdcheckRuleJar.getRuleSetVersion().equals(fileVersion)){
                    renderJson(new BaseResponseBean(-1,"请修改版本号"));
                    return ;
                }

                JSONArray datas = JSON.parseArray(data);
                if(datas==null || datas.size()==0){
                    renderJson(new BaseResponseBean(-1,"data数据解析失败"));
                    return ;
                }
                //提交文件到云存储返回jar包下载地址
                String suffix = file.getOriginalFileName().substring(file.getOriginalFileName().lastIndexOf(".") + 1);
                String newFileName = MBase64.encode(UUID.randomUUID().toString()+UUID.randomUUID().toString(),"utf-8")+"."+suffix;
                JdS3Client.uploadObject(jarBucketName,newFileName,file.getFile());
//            String md5 = JdClient.getInstance().getNewClient().bucket(jarBucketName).object(newFileName).entity(file.getFile()).put();
                String downloadUrl = ENDPOINT+"/"+jarBucketName+"/"+newFileName;
                jdcheckRuleJar.setUrl(downloadUrl);
                jdcheckRuleJar.setRuleSetVersion(fileVersion);
                jdcheckRuleJar.update();
                //更新规则
                for(int i=0;i<datas.size();i++){
                    if(datas.getJSONObject(i).getBoolean("exist")){
                        JdcheckRule jdcheckRule = JSON.parseObject(datas.getJSONObject(i).getString("jdcheckRule"),JdcheckRule.class);
                        List<JdcheckRule> temp = JdcheckRule.dao.getJdCheckRuleByName(jdcheckRule.getRuleName());
                        if(temp!=null && temp.size()>0){
                            JdcheckRule ori = temp.get(0);
                            if(ori.getFromJarId().intValue()==jdcheckRuleJar.getId()){
                                if(datas.getJSONObject(i).getBoolean("select")){
                                    ori.setPlatform(jdcheckRule.getPlatform());
                                    ori.setErrorLevel(jdcheckRule.getErrorLevel());
                                    ori.setExample(jdcheckRule.getExample());
                                    ori.setAuthor("/"+jdcheckRule.getAuthor()+"/");
                                    ori.setDescription(jdcheckRule.getDescription());
                                    ori.setRuleType(jdcheckRule.getRuleType());
                                    ori.setBrief(jdcheckRule.getBrief());
                                    ori.update();

                                    //可适用moduleIds
                                    List<Integer> moduleId = new ArrayList();
                                    String moduleIdString = datas.getJSONObject(i).getString("modules");
                                    if(!StringUtil.isEmpty(moduleIdString)){
                                        String[] temps = moduleIdString.split("/");
                                        if(temps!=null && temps.length>0){
                                            for(int j=0;j<temps.length;j++){
                                                if(temps[j]!=null && temps[j].length()>0){
                                                    try{
                                                        int a = Integer.parseInt(temps[j]);
                                                        moduleId.add(a);
                                                    }catch (Exception e){
                                                        e.printStackTrace();
                                                    }
                                                }
                                            }
                                        }
                                    }
                                    List<JdcheckRuleset> jdcheckRulesets = JdcheckRuleset.dao.find("select * from jdcheck_ruleset where rule_id=?",ori.getId());
                                    if(jdcheckRulesets==null){
                                        jdcheckRulesets = new ArrayList<>();
                                    }
                                    for(int m=0;m<jdcheckRulesets.size();m++){
                                        boolean hasAdd = false;
                                        for(int n=0;n<moduleId.size();n++){
                                            if(jdcheckRulesets.get(m).getModuleId().intValue()==moduleId.get(n).intValue()){
                                                hasAdd = true;
                                                moduleId.remove(n);
                                                break;
                                            }
                                        }
                                        if(!hasAdd){
                                            jdcheckRulesets.get(m).delete();
                                        }
                                    }
                                    for(int n=0;n<moduleId.size();n++){
                                        JdcheckRuleset t = new JdcheckRuleset();
                                        t.setRuleId(ori.getId());
                                        t.setModuleId(moduleId.get(n));
                                        t.save();
