//        System.out.println("graySwitch:" + String.valueOf(graySwitch));


        /**
         * 灰度名单,判断当前上传erp是否是bjtandingqiang下的成员
         *
         * EOSPluginGraySwitch 只灰度bjtandingqiang下的成员
         *
         */

        boolean EOSPluginGraySwitch = false;
        if (graySwitch) {
//            String androidGrayList = "project_watcher.erp='bjtandingqiang' or project_watcher.erp='bjcban'";
            //使用服务端下发的方式进行灰度配置
            EOSPluginGraySwitch = getGraySwitch(generateWatcherSql(3), erpName);
        }

        /**
         * 智能助理插件,使用动态配置,判断是否开启
         */
        boolean superenterSwitch = getGraySwitch(generateWatcherSql(2), erpName);


        //查找所有插件信息
        List<PluginUpdate> pluginUpdates = PluginUpdate.dao.findAll();
        //创建结果
        List<PluginVersionBean> result = new ArrayList<>();

        for (PluginUpdate pluginUpdate : pluginUpdates) {
            //生成下发实体
            PluginVersionBean pluginVersionBean = createPluginVersionBean(pluginUpdate);

            if (pluginUpdate.getModuleId().equals("com.jd.p3c.smartfox")) {
                if (EOSPluginGraySwitch) {
                    if (pluginUpdate.getProjectId().equals("EOSPluginGray")) {
                        result.add(pluginVersionBean);
                    }
                } else {
                    if (pluginUpdate.getProjectId().equals("EOSPlugin")) {
                        result.add(pluginVersionBean);
                    }
                }
            } else if (pluginUpdate.getModuleId().equals("com.jd.fastcode")) {
                /**
                 * 判断是否需要下发ffc 若不需要下发ffc
                 * 不需要时不生成ffc pluginVersionBean
                 */
                if (ffcDowload) {
                    result.add(pluginVersionBean);
                }
            } else if (pluginUpdate.getModuleId().equals("com.jd.tools.superenter")) {
                if (superenterSwitch) {
                    result.add(pluginVersionBean);
                }

            } else {
                //添加到结果
                if (!pluginVersionBean.getProjectId().equals("EOSJSVscode")) {
                    result.add(pluginVersionBean);
                }
            }

        }
        renderJson(JSON.toJSONString(new BaseResponseBean<List<PluginVersionBean>>(result)));
    }

    /**
     * 使得pluginUpdate->PluginVersionBean
     *
     * @param pluginUpdate
     * @return
     */
    private PluginVersionBean createPluginVersionBean(PluginUpdate pluginUpdate) {
        PluginVersionBean pluginVersionBean = new PluginVersionBean();
        pluginVersionBean.setProjectId(pluginUpdate.getProjectId());
        pluginVersionBean.setDownloadUrl(pluginUpdate.getUrl());
        pluginVersionBean.setModuleId(pluginUpdate.getModuleId());
        pluginVersionBean.setVersionCode(pluginUpdate.getVersionCode());
        pluginVersionBean.setVersionMust(pluginUpdate.getVersionMust());
        pluginVersionBean.setVersionName(pluginUpdate.getVersionName());
        pluginVersionBean.setVersionTip(pluginUpdate.getVersionTip());
        return pluginVersionBean;
    }

    /**
     * 对应jdcheck.plugin_conflict id=2 pluginName中的内容进行分割,生成数组
     * 用于动态设置 智能助理 下发的小组成员
     *
     * @return 返回的 (project_watcher.erp='bjtandingqiang'or project_watcher.erp='bjcban') 拼接字符串的形式
     */
    private String generateWatcherSql(int id) {
        StringBuilder stringBuilder = new StringBuilder();

        String sourceStr = PluginConflict.dao.find("select * from plugin_conflict where id = " + String.valueOf(id)).get(0).getPluginName();

        if (sourceStr.equals("")) {
            return null;
        }

        String sourceStrArray[] = sourceStr.split(",");
        if (sourceStrArray.length > 0) {
            stringBuilder.append("(");
        }
        for (int i = 0; i < sourceStrArray.length; i++) {
            if (i == 0) {
                stringBuilder.append("project_watcher.erp='" + sourceStrArray[i] + "'");
            } else {
                stringBuilder.append("or project_watcher.erp='" + sourceStrArray[i] + "'");
            }
        }
        if (!stringBuilder.toString().equals("")) {
            stringBuilder.append(")");
        }
        return stringBuilder.toString();

    }

    /**
     * 使用观察者查找观察者名下的小组成员,project_watcher.`level` in (1,2)
     *
     * @param str     观察者字符串（以,分割字符串）
     * @param erpName 上传请求的erp名称
     * @return 返回开关是否开启, erp名称是否包含在列表中
     */
    private Boolean getGraySwitch(String str, String erpName) {
        boolean grayLevelList;//是否是丁强下的成员
        /**
         * 适配superenter只在丁强组下发,每次都需要进行组员信息确认
         */
        List<ProjectModuleUser> projectModuleUserList = ProjectModuleUser.dao.find("select project_module_user.* from project_watcher,project_module_info,project_module_user where project_watcher.project_id=project_module_info.project_id and project_module_info.id=project_module_user.module_id and project_watcher.`level` in (1,2) and " + str);
        List<String> erpList = new ArrayList<>();
        for (int i = 0; i < projectModuleUserList.size(); i++) {
            if (!TextUtils.isEmpty(projectModuleUserList.get(i).getErp())) {
                erpList.add(projectModuleUserList.get(i).getErp());
            }
        }
        if (erpList.contains(erpName)) {
            grayLevelList = true;
        } else {
            grayLevelList = false;
        }
        return grayLevelList;
    }

