    }

    @ActionKey("sql/action_getTableData")
    public void getTableData() {
        boolean isMaster = ProjectWatcher.dao.isMaster(LoginUtil.getUserName(this));
        if (!isMaster) {
            renderJson(new BaseResponseBean(-1, "你没有最高权限！"));
            return;
        }
        List<TableMeta> tables = SingleMetaBuilder.tablelists;
        if (tables == null) {
            tables = new ArrayList<>();
        }
        String choiceTable = getPara("choice_table", null);
        if (!StringUtil.isEmpty(choiceTable)) {
            for (TableMeta item : tables) {
                if (item.name.equals(choiceTable)) {
                    int page = getParaToInt("page", 1);
                    String where = getPara("sql", "");
                    Page<Record> datas = Db.paginate(page, 50, "select " + item.name + ".*", "from " + item.name + " " + where);
                    renderJson(new BaseResponseBean(JSON.toJSON(datas)));
                    return;
                }
            }
            renderJson(new BaseResponseBean(-2, "不存在该表!"));
        } else {
            renderJson(new BaseResponseBean(-1, "缺少关键参数"));
            return;
        }
    }

    @ActionKey("sql/download")
    @Clear(LoginIntercept.class)   //需要打开的页面的位置需要添加这个
    public void downloadTableData() {
        /*
        需要打开界面的就需要添加这一段 用于判断是否需要跳转到登录页
         */
        if (!LoginUtil.login(this)) {
            return;
        }
        boolean isMaster = ProjectWatcher.dao.isMaster(LoginUtil.getUserName(this));
        if (!isMaster) {
            renderText("你没有最高权限！");
            return;
        }
        String tableName = getPara("tableName", null);
        if (StringUtil.isEmpty(tableName)) {
            renderText("缺少tableName参数");
            return;
        }
        List<TableMeta> tables = SingleMetaBuilder.tablelists;
        TableMeta table = null;
        for (TableMeta item : tables) {
            if (item.name.equals(tableName)) {
                table = item;
                break;
            }
        }
        if (table == null) {
            renderText("不存在该表");
            return;
        }
        String selectWhere = getPara("selectWhere", null);
        if (!StringUtil.isEmpty(selectWhere)) {
            try {
                selectWhere = URLDecoder.decode(selectWhere);
            } catch (Exception e) {

            }
        }
        List<Record> data = null;
        try {
            if (table.name.equals("jdcheck_history")) {
                if (StringUtil.isEmpty(selectWhere)) {
                    data = Db.find("select id,job_num,module_id,erp,username,email,branch,create_time,jenkins,result_id,job_state from jdcheck_history");
                } else {
                    data = Db.find("select id,job_num,module_id,erp,username,email,branch,create_time,jenkins,result_id,job_state from jdcheck_history " + selectWhere);
                }
            } else {
                if (StringUtil.isEmpty(selectWhere)) {
                    data = Db.find("select * from " + table.name);
                } else {
                    data = Db.find("select * from " + table.name + " " + selectWhere);
                }
            }
        } catch (Exception e) {
            renderJson(new BaseResponseBean(-1, "SQL语句错误"));
            return;
        }
        if (data == null || data.size() == 0) {
            renderText(table.name + " 无数据");
            return;
        }
        if (data == null || data.size() >= 200000) {
            renderText("数据量超多了20W条数据，请分步下载再自行本地拼接");
            return;
        }
        String type = getPara("type", "sql");
        if (type.equals("sql")) {
            String filePath = PathKit.getWebRootPath() + "/" + LoginUtil.getUserName(this) + "_" + table.name + ".sql";
            boolean success = WriteExcel.writeEmployeeListToSQL(filePath, table, data);
            if (!success) {
                renderText(table.name + " 生成sql文件失败");
                return;
            } else {
                File file = new File(filePath);
                if (!file.exists()) {
                    renderText(table.name + " 生成sql文件失败");
                    return;
                } else {
                    renderFile(file);
                }
            }
        } else {
            String filePath = PathKit.getWebRootPath() + "/" + LoginUtil.getUserName(this) + "_" + table.name + ".xlsx";
            boolean success = WriteExcel.writeEmployeeListToExcel(filePath, table, data);
            if (!success) {
                renderText(table.name + " 生成excel表失败");
                return;
            } else {
                if (filePath.toLowerCase().endsWith("xlsx")) {//2003
                    filePath = filePath.substring(0, filePath.length() - 1);  //因为该类写出来的后缀为.xlsx文件无法打开 需要更改后缀为.xls
                }
                File file = new File(filePath);
                if (!file.exists()) {
                    renderText(table.name + " 生成excel文件失败");
                    return;
                } else {
                    renderFile(file);
                }
            }
        }
    }

    /**
     * 添加新项目
     */
    @ActionKey("sql/action_add_new_project")
    public void addNewProject() {
        boolean isMaster = ProjectWatcher.dao.isMaster(LoginUtil.getUserName(this));
        if (!isMaster) {
            renderJson(new BaseResponseBean(-1, "你没有最高权限！"));
            return;
        }
        String name = getPara("name", null);
        if (StringUtil.isEmpty(name)) {
            renderJson(new BaseResponseBean(-1, "缺少必要字符"));
            return;
        }
        List<Project> projects = Project.dao.find("select * from project where name=?", name);
        if (projects != null && projects.size() > 0) {
            renderJson(new BaseResponseBean(-1, "已经存在，如果还是需要添加请修改名称"));
            return;
        }
        Integer order = getParaToInt("order", null);
        if (order == null) {
            List<Project> temps = Project.dao.find("select * from project order by project.order desc");
            if (temps != null && temps.size() > 0) {
                int temp = temps.get(0).getOrder();
                temp = (temp / 100 + 1) * 100;
                order = temp;
            }
        }
        Project project = new Project();
        project.setName(name);
        project.setOrder(order);
        project.save();
        renderJson(new BaseResponseBean<Project>(project));
    }

