controller", "class_name": "SqlWatchController", "variable": null, "priority": "3", "method": null, "description": "public class SqlWatchController extends Controller {
    public static final long ONEDAY = 86400000;
    public static final int DELETE_DAYS = 32;

    @ActionKey("sql/select")
    @Clear(LoginIntercept.class)   //需要打开的页面的位置需要添加这个
    public void sqlSelectIndex() {
        /*
        需要打开界面的就需要添加这一段 用于判断是否需要跳转到登录页
         */
        if (!LoginUtil.login(this)) {
            return;
        }
        boolean isMaster = ProjectWatcher.dao.isMaster(LoginUtil.getUserName(this));
        if (!isMaster) {
            renderText("你没有最高权限！");
            return;
        }
        SqlCheckBean sqlCheckBean = new SqlCheckBean();
        long projectNum = 0;
        long existProjectNum = 0;
        long moduleNum = 0;
        long eosWebUserNum = 0;
        long appNum = 0;
        long pluginUserNum = 0;
        long onlyPluginUserNum = 0;
        //查询project数量
        List<Record> projectData = Db.find("select count(*) from project");
        if (projectData != null && projectData.size() > 0) {
            projectNum = projectData.get(0).get("count(*)");
        }
        //查询有工程的project数量
        List<Record> existProjectData = Db.find("select count(distinct project_id) from project_module_info");
        if (existProjectData != null && existProjectData.size() > 0) {
            existProjectNum = existProjectData.get(0).get("count(distinct project_id)");
        }
        //查询接入工程数量
        List<Record> data = Db.find("select count(*) from project_module_info");
        if (data != null && data.size() > 0) {
            moduleNum = data.get(0).get("count(*)");
        }
        //查询web成员总数
        List<Record> data2 = Db.find("select count(distinct erp) from project_module_user");
        if (data2 != null && data2.size() > 0) {
            eosWebUserNum = data2.get(0).get("count(distinct erp)");

        }
        //查询接入工程app个数
        List<Record> data3 = Db.find("select count(distinct project_module_info.appid) from project_module_app,project_module_info where  project_module_app.id=project_module_info.appid and  project_module_app.appgroup='移动APP'");
        if (data3 != null && data3.size() > 0) {
            appNum = data3.get(0).get("count(distinct project_module_info.appid)");
        }
        //IDE插件用户数
        List<Record> data4 = Db.find("select count(distinct uniqueId) from plugin_local_point");
        if (data4 != null && data4.size() > 0) {
            pluginUserNum = data4.get(0).get("count(distinct uniqueId)");
        }
        //单独下载IDE插件用户数
        List<Record> data5 = Db.find("select count(distinct erp_name) from only_plugin_user");
        if (data5 != null && data5.size() > 0) {
            onlyPluginUserNum = data5.get(0).get("count(distinct erp_name)");
        }
        sqlCheckBean.setProjectNum(projectNum);
        sqlCheckBean.setExistProjectNum(existProjectNum);
        sqlCheckBean.setModuleNum(moduleNum);
        sqlCheckBean.setEosWebUserNum(eosWebUserNum);
        sqlCheckBean.setAppNum(appNum);
        sqlCheckBean.setPluginUserNum(pluginUserNum);
        sqlCheckBean.setOnlyPluginUserNum(onlyPluginUserNum);
