    @ActionKey("/sql/select/deleteProjectHistoryByModuleId")
    public void deleteProjectHistoryByModuleId() {
        boolean isMaster = ProjectWatcher.dao.isMaster(LoginUtil.getUserName(this));
        if (!isMaster) {
            renderJson(new BaseResponseBean(-1, "你没有最高权限！"));
            return;
        }
        Integer moduleId = null;
        boolean deleteModule = false;

        try {
            moduleId = getParaToInt("moduleId", null);
            deleteModule = getParaToBoolean("deleteModule", false);
        } catch (Exception e) {
            renderJson(new BaseResponseBean(-1, "moudleId输入有误，请检查后提交!"));
            return;
        }
        if (moduleId == null) {
            renderJson(new BaseResponseBean(-1, "请输入moduleId"));
        }
        List<JdcheckHistory> list = JdcheckHistory.dao.find("select * from jdcheck_history where module_id=?", moduleId);
        if (list != null && list.size() > 0) {
            for (JdcheckHistory history : list) {
                if (history.getResultId() != null) {
                    List<JdcheckResult> results = JdcheckResult.dao.find("select * from jdcheck_result where id=?", history.getResultId());
                    if (results != null && results.size() > 0) {
                        for (JdcheckResult jdcheckResult : results) {
                            jdcheckResult.delete();
                        }
                    }
                    List<JdcheckResultFile> resultFiles = JdcheckResultFile.dao.find("select * from jdcheck_result_file where resultid=?", history.getResultId());
                    if (resultFiles != null && resultFiles.size() > 0) {
                        for (JdcheckResultFile jdcheckResultFile : resultFiles) {
                            jdcheckResultFile.delete();
                        }
                    }
                    List<JdcheckResultDetail> resultDetails = JdcheckResultDetail.dao.find("select * from jdcheck_result_detail where resultid=?", history.getResultId());
                    if (resultDetails != null && resultDetails.size() > 0) {
                        for (JdcheckResultDetail jdcheckResultDetail : resultDetails) {
                            jdcheckResultDetail.delete();
                        }
                    }

                }
                history.delete();
                if (deleteModule) {
                    List<ProjectModuleUser> projectModuleUsers = ProjectModuleUser.dao.find("select * from project_module_user where module_id=?", moduleId);
                    if (projectModuleUsers != null && projectModuleUsers.size() > 0) {
                        for (ProjectModuleUser p : projectModuleUsers) {
                            p.delete();
                        }
                    }

                    ProjectModuleInfo projectModuleInfo = ProjectModuleInfo.dao.findById(moduleId);
                    if (projectModuleInfo != null) {
                        projectModuleInfo.delete();
