                } else {
                    renderJson(new BaseResponseBean(0, "扫描历史删除成功"));
                }
            }
        }

    }

    @ActionKey("/sql/select/getModuleCountGroupByProject")
    public void getModuleCountGroupByproject() {
        boolean isMaster = ProjectWatcher.dao.isMaster(LoginUtil.getUserName(this));
        if (!isMaster) {
            renderJson(new BaseResponseBean(-1, "你没有最高权限！"));
            return;
        }

        List<Project> projects = Project.dao.find("select * from project");
        if (projects == null || projects.size() == 0) {
            renderJson(new BaseResponseBean(-1, "暂无project接入!"));
            return;
        } else {
            List<ModuleGroupByProjectBean> list = new ArrayList<>();
            for (Project project : projects) {
                long countModuleAndroid = 0;
                long countModuleJava = 0;
                long countModuleIos = 0;
                long countModuleAll = 0;
                ModuleGroupByProjectBean bean = new ModuleGroupByProjectBean();
                bean.setProjectId(project.getId());
                bean.setProjectName(project.getName());
                List<Record> moduleAlldata = Db.find("select count(*) from project_module_info where project_id=?", project.getId());
                if (moduleAlldata != null) {
                    countModuleAll = moduleAlldata.get(0).get("count(*)");
                }
                bean.setCountModuleAll(countModuleAll);
                List<Record> moduleAndroiddata = Db.find("select count(*) from project_module_info where project_id=? and platform='android'", project.getId());
                if (moduleAndroiddata != null) {
                    countModuleAndroid = moduleAndroiddata.get(0).get("count(*)");
                }
                bean.setCountModuleAndroid(countModuleAndroid);
                List<Record> moduleJavadata = Db.find("select count(*) from project_module_info where project_id=? and platform='java'", project.getId());
                if (moduleJavadata != null) {
                    countModuleJava = moduleJavadata.get(0).get("count(*)");
                }
                bean.setCountModuleJava(countModuleJava);
                List<Record> moduleIosdata = Db.find("select count(*) from project_module_info where project_id=? and platform='ios'", project.getId());
                if (moduleIosdata != null) {
                    countModuleIos = moduleIosdata.get(0).get("count(*)");
                }
                bean.setCountModuleIos(countModuleIos);
                list.add(bean);

            }

            List<ModuleGroupByProjectBean> result = sortProjectList(list);
            renderJson(new BaseResponseBean<Object>(0, JSON.toJSON(result)));
        }

    }

    /**
     * 对项目组排序
     *
     * @param list
     * @return
     */
    public List<ModuleGroupByProjectBean> sortProjectList(List<ModuleGroupByProjectBean> list) {
        if (list != null && list.size() > 0) {
            for (int i = 0; i < list.size() - 1; i++) {
                for (int j = 1; j < list.size() - i; j++) {
                    ModuleGroupByProjectBean bean;
                    long up = list.get(j - 1).getCountModuleAll();
                    long current = list.get(j).getCountModuleAll();
                    if ((up - current) < 0) { // 比较两个整数的大小
                        bean = list.get(j - 1);
                        list.set((j - 1), list.get(j));
                        list.set(j, bean);
                    }
                }
            }

        }
        return list;
    }

