    public JdCheckAnalyBean getModuleAnalyWeekDatas(long endTime, int timeCount, ProjectModuleInfoUserBean item, boolean isDetail) {
        long[] times = new long[timeCount];
        for (int i = 0; i < timeCount; i++) {
            times[i] = endTime - ONEDAY * (timeCount - 1 - i);
        }
        JdCheckAnalyBean result = new JdCheckAnalyBean();

        result.setTitle(item.getModuleCn() + (item.getOuttime() == null ? "" : "(已过期)"));
        result.setTime(item.getTime());
        result.setOuttime(item.getOuttime());
        result.setOutreason(item.getOutreason());
        result.setModuleCn(item.getModuleCn());
        result.setModuleEn(item.getModuleEn());
        result.setModuleId(item.getId());
        result.setProjectId(item.getProjectId());
        result.setProjectName(item.getProjectName());
        if (isDetail) {
            result.setTitle(result.getTitle() + "_" + ProjectModuleUser.dao.getModuleMaster(result.getModuleId()));
        }
        setModuleAnalyWeekData(result, times, isDetail);

        return result;
    }

    private void setModuleAnalyWeekData(JdCheckAnalyBean result, long[] times, boolean isDetail) {
        SimpleDateFormat simpleDateFormat = new SimpleDateFormat("MM月dd日");
        List<String> labels = new ArrayList<String>();
        for (int j = 0; j < times.length; j++) {
            labels.add(simpleDateFormat.format(times[j]));
        }
        List<Integer> blocker = new ArrayList<Integer>();
        List<Integer> critical = new ArrayList<Integer>();
        List<Integer> major = new ArrayList<Integer>();
        List<Integer> warning = new ArrayList<Integer>();
        List<Integer> num = new ArrayList<Integer>();
        String durBranch = setFirstDataModuleAnalyWeek(result.getModuleId(), result.getOuttime(), blocker, critical, major, warning, num, labels, times[0], isDetail);
        for (int i = 1; i < times.length; i++) {
            if (result.getOuttime() == null || result.getOuttime().getTime() > times[i]) {
                JdCheckHistoryDetail t = ModuleDayResultCache.cache.getDataModuleAnaly(result.getModuleId(), times[i]);
                if (t == null) {
                    blocker.add(blocker.get(i - 1));
                    critical.add(critical.get(i - 1));
                    major.add(major.get(i - 1));
                    warning.add(warning.get(i - 1));
                    num.add(num.get(i - 1));
                    if (isDetail && (blocker.get(i - 1) != null || critical.get(i - 1) != null || major.get(i - 1) != null || warning.get(i - 1) != null)) {
                        String ta = labels.get(i);
                        labels.set(i, ta + "-未扫描");
                    }
                } else {
                    blocker.add(t.getBlocker());
                    critical.add(t.getCritical());
                    major.add(t.getMajor());
                    warning.add(t.getWarning());
                    num.add(t.getNum());
                    if (isDetail) {
                        String ta = labels.get(i);
                        if (!t.getBranch().equals(durBranch)) {
                            labels.set(i, ta + "-" + t.getBranch());
                            durBranch = t.getBranch();
                        }
                    }
                }
            } else {
                if(result.getOuttime() == null || result.getOuttime().getTime() > times[i]-DAYSTARTCUT){
                    JdCheckHistoryDetail t = ModuleDayResultCache.cache.getDataModuleAnaly(result.getModuleId(), times[i]);
                    if(t!=null && t.getCreateTime().getTime()<=result.getOuttime().getTime()){
                        blocker.add(t.getBlocker());
                        critical.add(t.getCritical());
                        major.add(t.getMajor());
                        warning.add(t.getWarning());
                        num.add(t.getNum());
                    }else{
                        blocker.add(null);
                        critical.add(null);
                        major.add(null);
                        warning.add(null);
                        num.add(null);
                    }
                }else{
                    blocker.add(null);
                    critical.add(null);
                    major.add(null);
                    warning.add(null);
                    num.add(null);
                }
                if (isDetail) {
                    String ta = labels.get(i);
                    labels.set(i, ta + "-已过期");
                }
            }
        }

        result.setBlocker(blocker);
        result.setCritical(critical);
        result.setMajor(major);
        result.setWarning(warning);
        result.setNum(num);
        result.setLabels(labels);
    }

    private String setFirstDataModuleAnalyWeek(int moduleId, Date outtime, List<Integer> blocker, List<Integer> critical, List<Integer> major, List<Integer> warning, List<Integer> num, List<String> labels, long time, boolean isDetail) {
        if (outtime == null || outtime.getTime() > time) {
            JdCheckHistoryDetail t = ModuleDayResultCache.cache.getDataModuleAnaly(moduleId, time);
            if (t == null) {
                JdCheckHistoryDetail t2 = ModuleDayResultCache.cache.getFirstDataModuleAnalyBefore(moduleId, time);
                if (t2 != null) {
                    blocker.add(t2.getBlocker());
                    critical.add(t2.getCritical());
                    major.add(t2.getMajor());
                    warning.add(t2.getWarning());
                    num.add(t2.getNum());
                    if (isDetail) {
                        String temp = labels.get(0);
                        labels.set(0, temp + "-" + t2.getBranch() + "-未扫描");
                    }
                    return t2.getBranch();
                } else {
                    blocker.add(null);
                    critical.add(null);
                    major.add(null);
                    warning.add(null);
                    num.add(null);
                    if (isDetail) {
                        String temp = labels.get(0);
                        labels.set(0, temp + "-未扫描");
                    }
                    return null;
                }
            } else {
                blocker.add(t.getBlocker());
                critical.add(t.getCritical());
                major.add(t.getMajor());
                warning.add(t.getWarning());
                num.add(t.getNum());
                if (isDetail) {
                    String temp = labels.get(0);
                    labels.set(0, temp + "-" + t.getBranch());
                }
                return t.getBranch();
            }
        } else {
            blocker.add(null);
            critical.add(null);
            major.add(null);
            warning.add(null);
            num.add(null);
            if (isDetail){
                String temp = labels.get(0);
                labels.set(0, temp + "-已过期");
            }
            return null;
        }
    }

