    public JdCheckAnalyBean getProjectAnalyDatas(Project itemProject, long endTime, int timeCount, String platform) {
        JdCheckAnalyBean result = new JdCheckAnalyBean();
        result.setTitle(itemProject.getName());
        result.setProjectId(itemProject.getId());
        result.setProjectName(itemProject.getName());
        long timeA = System.currentTimeMillis();
