                int ctotal = 0;
                int msize = 0;
                int mtotal = 0;
                int wsize = 0;
                int wtotal = 0;

                int nsize = 0;
                int ntotal = 0;
                for (int i = 0; i < tempDatas.size(); i++) {
                    if (tempDatas.get(i).getBlocker().get(j) != null) {
                        bsize++;
                        btotal = btotal + tempDatas.get(i).getBlocker().get(j);
                    }
