    public boolean projectisNewJoin(Integer projectId) {

        Calendar curCalendar = Calendar.getInstance(Locale.CHINA);
        curCalendar.set(Calendar.HOUR_OF_DAY, 0);
        curCalendar.set(Calendar.MINUTE, 0);
        curCalendar.set(Calendar.SECOND, 0);
        curCalendar.set(Calendar.MILLISECOND, 0);
        long curTime = curCalendar.getTimeInMillis();
        Date date = new Date(curTime - jugeNewJoinDuring * ONEDAY);
        List<Project> newProjectList = find("select id from project where project.id not in (select project_id from project_module_info where project_module_info.time< ?  group by project_id ) and project.id in (select project_id from project_module_info group by project_id)", date);
        if (newProjectList == null || newProjectList.size() <= 0) {
            return false;
        } else {
            for (Project project : newProjectList) {
                if (project.getId().equals(projectId)) {
                    return true;
                }
            }
            return false;
        }

    }


