    public List<ProjectKindBean> getProjectKind(List<Project> projects) {
        if (projects == null || projects.size() == 0) {
            return null;
        }
        List<ProjectKindBean> result = new ArrayList<>();
        for (Project project : projects) {
            if (!TextUtils.isEmpty(project.getName())) {
                getProjectKind(result, project.getName().split("-"), 0, project);
            }
        }
        return result;
    }

    private void getProjectKind(List<ProjectKindBean> result, String[] names, int index, Project project) {
        if (names == null || names.length == 0 || names.length == index) {
            return;
        }

        ProjectKindBean projectKindBean = null;
        for (ProjectKindBean p : result) {
            if (p.getTitle().equals(names[index])) {
                projectKindBean = p;
                break;
            }
        }
        if (projectKindBean == null) {
            //新的一个组
            projectKindBean = new ProjectKindBean();
            projectKindBean.setTitle(names[index]);
            if (names.length - 1 == index) {
                projectKindBean.setProject(project);
            } else {
                List<ProjectKindBean> datas = new ArrayList<>();
                projectKindBean.setNext(datas);
                getProjectKind(datas, names, ++index, project);
            }
            result.add(projectKindBean);
        } else {
            getProjectKind(projectKindBean.getNext(), names, ++index, project);
        }
    }



