        List<Project> projects = Project.dao.find("select * from project where name=?", originization);
        if (projects == null || projects.size() == 0) {
            Project project = new Project();
            project.setName(originization);
            project.setJavajenkins(javaJenkins);
            project.save();
            projectId = project.getId();
        } else {
            projectId = projects.get(0).getId();
        }
        return projectId;
    }
