     *
     * @param gitUrl
     * @return
     */
    public boolean isExits(int projectId, String gitUrl) {
        boolean result = false;
        List<ProjectModuleInfo> datas = find("select count(*) from project_module_info where project_id=? and git_url = ?", projectId, gitUrl);
        if (datas != null && datas.size() > 0) {
            Long temp = datas.get(0).getLong("count(*)");
            if (temp != null && temp > 0) {
                result = true;
            }
        }
        return result;
    }

    public List<ProjectModuleInfo> getModuleListProjectByPlatform(int projectId, String platform) {
        if (platform == null) {
            return find("select id,module_en,module_cn,time,outtime,outreason from project_module_info where project_id = ?", projectId);
        } else {
            return find("select id,module_en,module_cn,time,outtime,outreason from project_module_info where project_id = ? and platform=?", projectId, platform);
        }
    }

    public List<ProjectModuleInfo> getModuleListProject(int projectId, Integer cModuleId) {
        List<ProjectModuleInfo> result;
        if (cModuleId == null) {
            result = find("select * from project_module_info where project_id = ?", projectId);
        } else {
            result = find("select * from project_module_info where project_id = ? and id=?", projectId, cModuleId);
        }
        if (result == null) {
