    public List<ProjectModuleInfo> getStructureModuleList(int projectId,String erp){
        List<ProjectModuleInfo> result= new ArrayList<>();
        if(ProjectWatcher.dao.isMaster(erp)){
            result = find("select * from project_module_info where project_id = ?", projectId);
        }
        else {
            result=find("select a.* from project_module_info a, project_module_user b where a.id=b.module_id and a.project_id=? and b.erp=? and b.level in (2,3)",projectId,erp);
        }

        return result;
    }



    public List<ProjectModuleInfo> getModuleListProjectByOrder(int projectId,Integer cModuleId,String erp){
        List<ProjectModuleInfo> result;
        if (cModuleId == null) {
            result = find("select project_module_info.* from project_module_info left join (select * from project_module_user where erp=?) a on project_module_info.id = a.module_id where project_id=? order by a.level desc", erp, projectId);
        } else {
            result = find("select * from project_module_info where project_id = ? and id=? ", projectId, cModuleId);
        }
        if (result == null) {
            result = new ArrayList<>();
        }
        return result;
