    public ProjectModuleInfo getModuleInfo(String gitUrl, String erp) {
        List<ProjectModuleInfo> projectModuleInfos = find("select project_module_info.* from project_module_info,project_module_user where project_module_info.id=project_module_user.module_id and git_url=? and erp=?", gitUrl, erp);
        if (projectModuleInfos != null && projectModuleInfos.size() > 0) {
            return projectModuleInfos.get(0);
        }
        return null;
    }

    public List<String> getModulePlatform(Integer projectId) {
        List<ProjectModuleInfo> datas = find("select platform from project_module_info where project_id=? group by platform", projectId);
        List<String> result = new ArrayList<>();
        if (datas != null && datas.size() > 0) {
            for (ProjectModuleInfo item : datas) {
                result.add(item.getPlatform());
            }
        }
        return result;
    }

    public EmailProjectStateBean getProjectState(Integer projectId, long endTime, int timeCount, String platform) {
        EmailProjectStateBean result = new EmailProjectStateBean();
        List<ProjectModuleInfo> projectModuleInfos;
        if (platform == null) {
            projectModuleInfos = find("select project_module_info.* from project_module_info where project_id=?", projectId);
        } else {
            projectModuleInfos = find("select project_module_info.* from project_module_info where project_id=? and platform=?", projectId, platform);
        }
        if (projectModuleInfos != null && projectModuleInfos.size() > 0) {
            for (int i = 0; i < projectModuleInfos.size(); i++) {
                List<JdcheckHistory> temp = JdcheckHistory.dao.find("select * from jdcheck_history where module_id=? and create_time>=? and create_time<=? order by create_time desc", projectModuleInfos.get(i).getId(), new Date(endTime - (timeCount - 1) * ONEDAY - DAYSTARTCUT), new Date(endTime));
                if (temp != null && temp.size() > 0) {
                    boolean isAllError = false;
                    for (int j = 0; j < temp.size(); j++) {
                        if (temp.get(j).getJobState() == 2) {
                            isAllError = true;
                            break;
                        }
                    }
                    if (!isAllError) {
                        result.getError().add(projectModuleInfos.get(i));
                        result.getErrorHistory().add(temp.get(0));
                    }
                } else {
                    result.getNever().add(projectModuleInfos.get(i));
                }
            }
        }

        return result;
    }

