mFile": null, "begin_line": "17", "end_line": "309", "begin_column": "8", "end_column": "1", "rule": "ClassMustHaveAuthorRule", "rule_set": "jdJavaComments", "package": "com.jd.jdcheck.model", "class_name": "ProjectModuleUser", "variable": null, "priority": "3", "method": null, "description": "public class ProjectModuleUser extends BaseProjectModuleUser<ProjectModuleUser> {
