    /**
     * 存在则更新 不存在则保存
     *
     * @return
     */
    public boolean saveOrUpdate() {
        List<ProjectModuleUser> datas = find("select * from project_module_user where module_id = ? and erp = ?", getModuleId(), getErp());
        if (datas != null && datas.size() > 0) {
            datas.get(0).setUsername(getUsername());
