        } else {
            return save();
        }
    }

    /**
     * 判断用户是否能手动触发扫描  级别只能是user表的2、3， 或者是watcher表的2、3
     *
     * @return
     */
    public boolean canBuildJob(int projectId, int moduleId, String erp) {
        List<ProjectWatcher> watchers = ProjectWatcher.dao.find("select * from project_watcher where erp=? and (level=3 or (level=2 and project_id=?))", erp, projectId);
        if (watchers != null && watchers.size() > 0) {
            return true;
        }
        List<ProjectModuleUser> datas = find("select level from project_module_user where module_id = ? and erp = ?", moduleId, erp);
        if (datas != null && datas.size() > 0) {
            if (datas.get(0).getLevel() == LEVEL_MEMBER || datas.get(0).getLevel() == LEVEL_OWNER) {
                return true;
            } else {
                return false;
            }
        } else {
            return false;
        }
    }

    /**
