    public List<ModuleUserBean> getChoiceOwner(int projectId, int moduleId) {
        List<ModuleUserBean> result = new ArrayList<>();
        List<ProjectWatcher> watchers = ProjectWatcher.dao.find("select * from project_watcher where level=1 and project_id=?", projectId);
        if (watchers != null && watchers.size() > 0) {
            for (int i = 0; i < watchers.size(); i++) {
                ModuleUserBean moduleUserBean = new ModuleUserBean();
                ProjectWatcher watcher = watchers.get(i);
                String erp = watcher.getErp();
                String userName = watcher.getUsername();
                moduleUserBean.setUserName(userName);
                moduleUserBean.setErp(erp);
                result.add(moduleUserBean);
            }

        }
        List<ProjectModuleUser> datas = find("select * from project_module_user where module_id = ? and level=3", moduleId);
        if (datas != null && datas.size() > 0) {
            for (ProjectModuleUser user : datas)
                if (!TextUtils.isEmpty(user.getErp()) && !TextUtils.isEmpty(user.getUsername())) {
                    boolean hasAdd = false;

                    for (int i = 0; i < result.size(); i++) {
                        ModuleUserBean bean = result.get(i);
                        if (user.getErp().equals(bean.getErp())) {
                            hasAdd = true;
                        }
                    }
                    if (!hasAdd) {
                        ModuleUserBean bean = new ModuleUserBean();
                        bean.setErp(user.getErp());
                        bean.setUserName(user.getUsername());
                        result.add(bean);
                    }
                }
        }
        return result;
    }


