    public String getModuleMaster(int moduleId) {
        List<ProjectModuleUser> datas = find("select username from project_module_user where level=3 and module_id=?", moduleId);
        if (datas != null && datas.size() > 0) {
            if (datas.size() == 1) {
                return datas.get(0).getUsername();
            } else {
                StringBuilder stringBuilder = new StringBuilder();
                for (int i = 0; i < datas.size(); i++) {
                    stringBuilder.append(datas.get(i).getUsername());
                    if (i < datas.size() - 1) {
                        stringBuilder.append("/");
                    }
                }
                return stringBuilder.toString();
            }
        }
        return null;
    }

