    public static BaseResponseBean<List<GitAccountInfoBean>> getGitMemberAccoutnList(String gitUrl, List<ProjectModuleUser> filtraUsers) {
        BaseResponseBean<List<GitMemberBean>> responseBean = getGitMember(gitUrl);
        if (responseBean.getCode() < 0) {
            return new BaseResponseBean(responseBean.getCode(), responseBean.getMsg());
        }
        if (responseBean.getData() == null || responseBean.getData().size() == 0) {
            return new BaseResponseBean<List<GitAccountInfoBean>>(new ArrayList<>());
        }
        List<GitAccountInfoBean> users = new ArrayList<>();
        for (GitMemberBean item : responseBean.getData()) {
            boolean needSave = true;
            for (int i = 0; i < filErp.length; i++) {
                if (item.getUsername().equals(filErp[i])) {
                    needSave = false;
                    break;
                }
            }
            if (needSave) {
                if (filtraUsers != null && filtraUsers.size() > 0) {
                    for (int i = 0; i < filtraUsers.size(); i++) {
                        if (item.getUsername().equals(filtraUsers.get(i).getErp())) {
                            needSave = false;
                            break;
                        }
                    }
                }
                if (needSave && Integer.parseInt(item.getAccess_level()) >= 30) {
                    AccountInfoBean accountInfoBean = LoginUtil.getUserInfoDetail(item.getUsername());
                    if (accountInfoBean != null) {
                        GitAccountInfoBean gitAccountInfoBean = new GitAccountInfoBean();
                        gitAccountInfoBean.setUserName(accountInfoBean.getUserName());
                        gitAccountInfoBean.setRealName(accountInfoBean.getRealName());
                        gitAccountInfoBean.setEmail(accountInfoBean.getEmail());
                        gitAccountInfoBean.setAccess_level(item.getAccess_level());
                        gitAccountInfoBean.setUserName(accountInfoBean.getUserName());
                        users.add(gitAccountInfoBean);
                    }
                }
            }
        }
        return new BaseResponseBean<>(users);
    }

    public static BaseResponseBean synchronizeMemberAndSave(Integer moduleId, String gitUrl) {
        List<ProjectModuleUser> projectModuleUsers = ProjectModuleUser.dao.getUserByModuleId(moduleId);
        BaseResponseBean<List<GitAccountInfoBean>> baseResponseBean = GitMemberUtil.getGitMemberAccoutnList(gitUrl, projectModuleUsers);
        if (baseResponseBean.getCode() < 0) {
            return new BaseResponseBean(baseResponseBean.getCode(), baseResponseBean.getMsg());
        }
        List<ProjectModuleUser> re = new ArrayList<>();
        if (baseResponseBean.getData() != null && baseResponseBean.getData().size() > 0) {
            for (int i = 0; i < baseResponseBean.getData().size(); i++) {
                if (!StringUtil.isEmpty(baseResponseBean.getData().get(i).getRealName()) && !StringUtil.isEmpty(baseResponseBean.getData().get(i).getUserName()) && !StringUtil.isEmpty(baseResponseBean.getData().get(i).getEmail())) {
                    ProjectModuleUser temp = new ProjectModuleUser();
                    temp.setModuleId(moduleId);
                    temp.setErp(baseResponseBean.getData().get(i).getUserName());
                    temp.setUsername(baseResponseBean.getData().get(i).getRealName());
                    temp.setEmail(baseResponseBean.getData().get(i).getEmail());
                    int level = 2;
                    String access_level = baseResponseBean.getData().get(i).getAccess_level();
                    if (!TextUtils.isEmpty(access_level) && Integer.valueOf(access_level) > 30) {
                        level = 3;
                    }
                    temp.setLevel(level);
                    List<ProjectModuleUser> ts = ProjectModuleUser.dao.find("select id from project_module_user where erp=? and username=? and email=? and module_id=?", temp.getErp(), temp.getUsername(), temp.getEmail(), moduleId);
                    if (ts == null || ts.size() == 0) {
                        temp.save();
                        re.add(temp);
                    }
                }
            }
        }
        return new BaseResponseBean(re);
    }


