    public static boolean login(Controller controller) {
        if (controller == null) {
            return false;
        }
        String ticket = controller.getCookie(COOKIE_TICKET_KEY);
        if (StringUtil.isEmpty(ticket)) {
            jumpLogin(controller);
            return false;
        }

        LoginResponseBean<LoginUserInfoBean> userInfo = LoginUtil.getVerifyTicket(ticket, controller.getRequest().getRequestURL().toString(), controller.getRequest().getRemoteAddr());
        if (userInfo != null && userInfo.getREQ_CODE() == 1) {

            controller.setCookie(LoginUtil.COOKIE_USER_ID_KEY, userInfo.getREQ_DATA().getUserId(), Integer.MAX_VALUE);
            controller.setCookie(LoginUtil.COOKIE_USER_NAME_KEY, userInfo.getREQ_DATA().getUsername(), Integer.MAX_VALUE);
            try {
                controller.setCookie(LoginUtil.COOKIE_FULL_NAME_KEY,  URLEncoder.encode(userInfo.getREQ_DATA().getFullname(), "UTF-8"), Integer.MAX_VALUE);
            } catch (UnsupportedEncodingException e) {
                e.printStackTrace();
            }
            controller.setCookie(LoginUtil.COOKIE_USER_EMAIL_KEY, userInfo.getREQ_DATA().getEmail(), Integer.MAX_VALUE);

            return true;
        }else{
            jumpLogin(controller);
            return false;
        }
    }

    private static void jumpLogin(Controller controller) {
        //最终跳转目标页的url拼接
        String goalUrl = controller.getRequest().getRequestURL().toString();
        Map parameterMap = controller.getRequest().getParameterMap();
        if (parameterMap != null && parameterMap.size() > 0) {
            goalUrl = goalUrl + "?";
            Iterator iter = parameterMap.entrySet().iterator();
            while (iter.hasNext()) {
                Map.Entry entry = (Map.Entry) iter.next();
                goalUrl = goalUrl + entry.getKey().toString() + "=";
                if (entry.getValue() != null && entry.getValue() instanceof String[] && ((String[]) entry.getValue()).length > 0) {
                    goalUrl = goalUrl + ((String[]) entry.getValue())[0].toString() + "&";
                } else {
                    goalUrl = goalUrl + entry.getValue().toString() + "&";
                }
            }
        }
        String wholePath = controller.getRequest().getRequestURL().toString();
        if(wholePath.endsWith("/")){
            wholePath = wholePath.substring(0,wholePath.length()-1);
        }
        String servletPath = controller.getRequest().getServletPath();
        if(servletPath.endsWith("/")){
            servletPath = servletPath.substring(0,servletPath.length()-1);
        }
        String result = wholePath;
        if(wholePath.contains(servletPath)){
            result = wholePath.substring(0,wholePath.lastIndexOf(servletPath));
        }

        String jumpUrl =result +"/erp/login";
        jumpUrl = jumpUrl + "?jumpUrl=" + goalUrl;
        try {
            jumpUrl = URLEncoder.encode(jumpUrl, "UTF-8");
        } catch (UnsupportedEncodingException e) {
            e.printStackTrace();
        }
        controller.redirect("http://sso.poc.ctrlle.com/sso/login?ReturnUrl=" + jumpUrl);
    }

    public static LoginResponseBean<String> getLastingTicket(String tempTicket, String url, String ip) {
