        requestTemp.put("url", url);
        requestTemp.put("ip", ip);
        requestTemp.put("app", ERP_LOGIN_APP_KEY);
        long time = System.currentTimeMillis();
        requestTemp.put("time", String.valueOf(time));
        requestTemp.put("sign", StringUtil.md5(ERP_LOGIN_APP_TOKEN + time + tempTicket));
        return JSON.parseObject(HttpKit.get(URL_LOGIN_GETTICKET, requestTemp), new TypeReference<LoginResponseBean<String>>() {
        });
    }

