        Map requestTemp = new HashMap();
        requestTemp.put("appCode", ACCOUNT_INFO_APPID);
        requestTemp.put("businessId", ACCOUNT_INFO_BUINESSID);
        requestTemp.put("requestTimestamp", requestTimestamp);
        requestTemp.put("sign", com.jd.official.omdm.utils.MD5Util.getSign(ACCOUNT_INFO_APPID, ACCOUNT_INFO_BUINESSID, requestTimestamp, ACCOUNT_INFO_SAFETY_KEY, erp));
