    public static String getUserId(Controller controller) {
        String result = controller.getCookie(COOKIE_USER_ID_KEY);
        if(StringUtil.isEmpty(result)){
            String tick = controller.getCookie(COOKIE_TICKET_KEY);
            if(!StringUtil.isEmpty(tick)){
                LoginResponseBean<LoginUserInfoBean> userInfo = LoginUtil.getVerifyTicket(tick, controller.getRequest().getRequestURL().toString(), controller.getRequest().getRemoteAddr());
                if (userInfo != null && userInfo.getREQ_CODE() == 1) {
                    result = userInfo.getREQ_DATA().getUserId();
                }else{
                    controller.removeCookie(COOKIE_TICKET_KEY);
                }
            }
        }
        return result;
    }

