    public static BaseResponseBean FuzzyQueryUserInfoByErp(String erp) {
        List<AccountInfoBean> list = new ArrayList<>();
        String response = HttpKit.get("http://api.gw.jd.com/upms/api/api_user/find_user?keyword=%" + erp+"%");
        if (!TextUtils.isEmpty(response)) {
            try {
                response = URLDecoder.decode(response, "utf-8");
                JSONObject source = (JSONObject) JSON.parse(response);
                if (source != null) {
                    String code = source.getString("status");
                    if (code.equals("success")) {
                        JSONArray array = source.getJSONArray("data");
                        if (array != null && array.size() > 0) {
                            for (int i = 0; i < array.size(); i++) {
                                JSONObject obj = (JSONObject) array.get(i);
                                String userErp = obj.getString("user_name");
                                String userName = obj.getString("real_name");
                                String email = obj.getString("email");
                                if (!TextUtils.isEmpty(userErp) && !TextUtils.isEmpty(userName) && !TextUtils.isEmpty(email)) {
                                    AccountInfoBean bean = new AccountInfoBean();
                                    bean.setUserCode("");
                                    bean.setUserName(userErp);
                                    bean.setRealName(userName);
                                    bean.setEmail(email);
                                    list.add(bean);
                                }
                            }

                        }
                    }
                }

            } catch (UnsupportedEncodingException e) {
                e.printStackTrace();
            }
        }
        return new BaseResponseBean(list);

    }


