    public static boolean writeRuleToDocx(int kind, String platform, String filePath, List<JdCheckRuleDocBean> jdCheckRuleDocs) {
        File file = new File(filePath);
        if (!file.getParentFile().exists()) {
            file.getParentFile().mkdirs();
        }
        if (file.exists()) {
            file.delete();
        }
        try {
            file.createNewFile();
        } catch (IOException e) {
            e.printStackTrace();
        }
        if (!filePath.toLowerCase().endsWith("docx")) {
            return false;
        }
        try {
            InputStream is_doc = PropKit.class.getClassLoader().getResourceAsStream("templet/doc_empty.docx");
            XWPFDocument doc = new XWPFDocument(is_doc);

            int position = 0;
            for (JdCheckRuleDocBean i : jdCheckRuleDocs) {
                position++;
                InputStream is_title = PropKit.class.getClassLoader().getResourceAsStream("templet/doc_title.docx");
                XWPFDocument doc_title = new XWPFDocument(is_title);
                Map<String, Object> titleData = new HashMap<>();
                titleData.put("position", position);
                titleData.put("title1", java.util.regex.Matcher.quoteReplacement(i.getRuleType()));
                replaceInPara(doc_title, titleData);
                mergeWord(doc, doc_title);
                try{
                    doc_title.close();
                    is_title.close();
                }catch (Exception e){

                }
                int postion_content = 0;
                for (JdcheckRule item : i.getJdcheckRules()) {
                    postion_content++;
                    InputStream is_title_content = PropKit.class.getClassLoader().getResourceAsStream("templet/doc_content.docx");
                    XWPFDocument doc_title_content = new XWPFDocument(is_title_content);
                    Map<String, Object> contentData = new HashMap<>();
                    if (kind == 1) {
                        String level;
                        if (item.getErrorLevel().toLowerCase().equals("low") || item.getErrorLevel().toLowerCase().equals("medium low")) {
                            level = "warning";
                        } else if (item.getErrorLevel().toLowerCase().equals("medium high")) {
                            level = "critical";
                        } else if (item.getErrorLevel().toLowerCase().equals("high")) {
                            level = "blocker";
                        } else {
                            level = "major";
                        }
                        contentData.put("title2",level);
                    } else {
                        contentData.put("title2",item.getRuleType()!=null?java.util.regex.Matcher.quoteReplacement(item.getRuleType()):null);
                    }
                    contentData.put("contentPosition", position + "." + postion_content);
                    contentData.put("title3",item.getBrief()!=null?java.util.regex.Matcher.quoteReplacement(item.getBrief()):null);
                    String example = item.getExample();
                    if(example==null || example.length()==0){
                        example = "暂无";
                    }
                    contentData.put("title4", java.util.regex.Matcher.quoteReplacement(example));
                    replaceInPara(doc_title_content, contentData);
                    mergeWord(doc, doc_title_content);
                    try{
                        doc_title_content.close();
                        is_title_content.close();
                    }catch (Exception e){

                    }
                }
            }
            OutputStream os = new FileOutputStream(file);
            //把doc输出到输出流
            doc.write(os);
            os.flush();
            os.close();
            is_doc.close();
            return true;
        } catch (Exception e) {
            e.printStackTrace();
        }
        return false;
    }

    /**
     * 替换段落里面的变量
     *
     * @param doc    要替换的文档
     * @param params 参数
     */
    private static void replaceInPara(XWPFDocument doc, Map<String, Object> params) {
        Iterator<XWPFParagraph> iterator = doc.getParagraphsIterator();
        XWPFParagraph para;
        while (iterator.hasNext()) {
            para = iterator.next();
            replaceInPara(para, params);
        }
    }

    /**
     * 替换段落里面的变量
     *
     * @param para   要替换的段落
     * @param params 参数
     */
    private static void replaceInPara(XWPFParagraph para, Map<String, Object> params) {
        List<XWPFRun> runs;
        Matcher matcher;

        String runText = "";
        if (matcher(para.getParagraphText()).find()) {
            runs = para.getRuns();
            if (runs.size() > 0) {
                for (int i = 0; i < runs.size(); i++) {
                    XWPFRun run = runs.get(i);
                    String i1 = run.toString();
                    runText += i1;
                    matcher = matcher(runText);
                    para.removeRun(i);
                    if (matcher.find()) {
                        String t = runText.substring(0,runText.indexOf("$%$"));
                        if(t!=null && t.length()>0){
                            para.insertNewRun(i).setText(t);
                            i++;
                            runText = runText.replace(t,"");
                        }
                        while ((matcher = matcher(runText)).find()) {
                            String keyT = matcher.group(1);
                            Object value = params.get(keyT);
                            try{
                                if(value==null || String.valueOf(value).length()==0){
                                    runText = "";
                                }else{
                                    runText = matcher.replaceFirst(String.valueOf(value));
                                    if(keyT.equals("title2")){
                                        runText = "【"+runText+"】";
                                    }
                                }
                            }catch (Exception e){
                                e.printStackTrace();
//                                System.out.println("----Doc_matcher: "+keyT+"  value: "+value+"  runText: "+runText);
                            }
                            XWPFRun xwpfRun = para.insertNewRun(i);
                            if(matcher.group(1)!=null && matcher.group(1).equals("title2")) {
                                para.getRuns().get(i).setBold(true);
                                xwpfRun.setText(runText);
                            }else if(matcher.group(1)!=null && matcher.group(1).equals("title4")){
                                para.getRuns().get(i).setFontSize(9);
                                runText = runText.replaceAll("\\\t","    ");
                                String[] d = runText.split("\\\n");
                                if(d!=null && d.length>0){
                                    for(int z=0;z<d.length;z++){
                                        xwpfRun.setText(d[z]);
                                        if(z<d.length-1){
                                            xwpfRun.addCarriageReturn();
                                        }
                                    }
                                }else{
                                    xwpfRun.setText(runText);
                                }
                            }else{
                                xwpfRun.setText(runText);
                            }
                            break;
                        }
                        runText = "";
                    }else{
                        i--;
                    }
                }
            }
        }
    }

    /**
     * 正则匹配字符串
     *
     * @param str
     * @return
     */
    private static Matcher matcher(String str) {
        Pattern pattern = Pattern.compile("\\$\\%\\$\\{(.+?)\\}", Pattern.CASE_INSENSITIVE);
        Matcher matcher = pattern.matcher(str);
        return matcher;
    }

    //两个对象进行追加
    public static void mergeWord(XWPFDocument document1, XWPFDocument document2) throws Exception {
        //设置分页符---当刚好一页数据时，会导致出现空白页，后面出现分页符导致格式有一点差异
        //解决方法是，在模板头上增加分页符
        //XWPFParagraph p = document2.createParagraph();
        //p.setPageBreak(true);
        CTBody src1Body = document1.getDocument().getBody();
        CTBody src2Body = document2.getDocument().getBody();
        List<XWPFPictureData> allPictures = document2.getAllPictures();
        // 记录图片合并前及合并后的ID
        Map<String, String> map = new HashMap();
        for (XWPFPictureData picture : allPictures) {
            String before = document2.getRelationId(picture);
            //将原文档中的图片加入到目标文档中
            String after = document1.addPictureData(picture.getData(), Document.PICTURE_TYPE_PNG);
            map.put(before, after);
        }
        appendBody(src1Body, src2Body, map);
    }

    private static void appendBody(CTBody src, CTBody append, Map<String, String> map) throws Exception {
        XmlOptions optionsOuter = new XmlOptions();
        optionsOuter.setSaveOuter();
        String appendString = append.xmlText(optionsOuter);

        String srcString = src.xmlText();
        String prefix = srcString.substring(0, srcString.indexOf(">") + 1);
        String mainPart = srcString.substring(srcString.indexOf(">") + 1, srcString.lastIndexOf("<"));
        String sufix = srcString.substring(srcString.lastIndexOf("<"));
        String addPart = appendString.substring(appendString.indexOf(">") + 1, appendString.lastIndexOf("<"));

        if (map != null && !map.isEmpty()) {
            //对xml字符串中图片ID进行替换
            for (Map.Entry<String, String> set : map.entrySet()) {
                addPart = addPart.replace(set.getKey(), set.getValue());
            }
        }
        //将两个文档的xml内容进行拼接
