        List<RuleDes> ruleDesList = new ArrayList<>(rules.size());
        for (RuleDes rule : rules) {
            try {
                RuleDes newRule = rule.clone();
                if(langCh.containsKey(newRule.getDescription())) {
                    newRule.setDescription(langCh.get(newRule.getDescription()));
                }
                if(langCh.containsKey(newRule.getMessage())){
                    newRule.setMessage(langCh.get(newRule.getMessage()));
                }
                ruleDesList.add(newRule);
            } catch (CloneNotSupportedException e) {
                e.printStackTrace();
            }
        }
        return ruleDesList;
    }
