    public List<RuleDes> parseRulesInJar(String file) {
        List<RuleDes> ruleDeses = new ArrayList<>();
        try {
            // 获得zip信息
            ZipFile zipFile = new ZipFile(file);
            Enumeration<ZipEntry> enu = (Enumeration<ZipEntry>) zipFile
                    .entries();
            while (enu.hasMoreElements()) {
                ZipEntry zipElement = enu.nextElement();
                String fileName = zipElement.getName();
                if (fileName.contains("rulesets")  && fileName.endsWith(".xml")) {// 是否为文件
                    InputStream read = zipFile.getInputStream(zipElement);
                    ruleDeses.addAll(perseRuleXml(zipElement, read));
                }
                if (fileName.contains("lang")  && fileName.endsWith(".xml")) {// 是否为文件
                    InputStream read = zipFile.getInputStream(zipElement);
                    if(fileName.endsWith("_en.xml")){
                        langEN.putAll(perseLangXml(zipElement, read));
                    }else {
                        langCh.putAll(perseLangXml(zipElement, read));
                    }
                }
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
        return ruleDeses;
    }



    private List<RuleDes> perseRuleXml(ZipEntry ze, InputStream read) {
        List<RuleDes> desList = new ArrayList<>();
        String group;
        try {
            DocumentBuilderFactory dbf = DocumentBuilderFactory.newInstance();
            DocumentBuilder db = dbf.newDocumentBuilder();
            Document document = db.parse(read);
            NodeList root = document.getChildNodes();
            for (int i = 0; i < root.getLength(); i++) {
                Node ruleSet = root.item(i);
                Node node = ruleSet.getAttributes().getNamedItem("name");
                group = nodeToString(node);
                NodeList rules = ruleSet.getChildNodes();
                for (int j = 0; j < rules.getLength(); j++) {
                    Node rule = rules.item(j);
                    if("rule".equals(rule.getNodeName())) {
                        RuleDes des = new RuleDes();
                        des.setGroup(group);
                        desList.add(des);
                        NodeList ruleData = rule.getChildNodes();
                        Node clazz = rule.getAttributes().getNamedItem("class");
                        Node lang = rule.getAttributes().getNamedItem("language");
                        Node message = rule.getAttributes().getNamedItem("message");
                        Node name = rule.getAttributes().getNamedItem("name");

                        String nodeStr = nodeToString(name);
                        if (nodeStr != null) {
                            int ruleIndex = nodeStr.lastIndexOf("Rule");
                            if (ruleIndex>0) {
                                nodeStr = nodeStr.substring(0,ruleIndex);
                            }
                            nodeStr = "Jd" + nodeStr;
                        }

                        des.setName(nodeStr);
                        des.setClazz(nodeToString(clazz));
                        des.setLang(nodeToString(lang));
                        des.setMessage(nodeToString(message));

                        String examples = "";
                        for (int k = 0; k < ruleData.getLength(); k++) {
                            Node property = ruleData.item(k);
                            switch (property.getNodeName()){
                                case "priority":
                                    des.setPriority(property.getTextContent());
                                    break;
                                case "example":
                                    examples = examples+property.getTextContent()+"\n";
                                    break;
                                case "description":
                                    des.setDescription(property.getTextContent());
                                    break;
                                default:break;
                            }
                        }
                        des.setExamples(examples);
                    }
                }
            }
        } catch (org.xml.sax.SAXException | ParserConfigurationException | IOException e) {
            e.printStackTrace();
        }
        return desList;
    }


    private Map<String,String> perseLangXml(ZipEntry ze, InputStream read) {
        Map<String,String> langs = new HashMap<>(10);
        try {
            DocumentBuilderFactory dbf = DocumentBuilderFactory.newInstance();
            DocumentBuilder db = dbf.newDocumentBuilder();
            Document document = db.parse(read);
            NodeList root = document.getChildNodes();
            for (int i = 0; i < root.getLength(); i++) {
                Node ruleSet = root.item(i);
                NodeList rules = ruleSet.getChildNodes();
                for (int j = 0; j < rules.getLength(); j++) {
                    Node rule = rules.item(j);
                    if ("entry".equals(rule.getNodeName())) {
                        langs.put(rule.getAttributes().getNamedItem("key").getNodeValue(), rule.getTextContent());
                    }
                }
            }
        }
        catch (FileNotFoundException e) {
            System.out.println("FileNotFoundException");
        }
        catch (org.xml.sax.SAXException | ParserConfigurationException | IOException e) {
            System.out.println("saxException:"+e);
        }
        return langs;
    }

    /**
     *
     * @param node
     * @return
     */
    private String nodeToString(Node node) {
        return node == null ? null : node.getNodeValue();
    }
